INSERT INTO `ps_product_lang` VALUES
('1','1','1','<p><strong>Lampa ścienna kinkiet loft różne kolory<br /></strong><br />Nowoczesny i unikalny design kinkietu wprowadzi do Twoich wnętrz elegancję i oryginalność. Spiralne łączenie oraz brak kloszy to świetny sposób na udekorowanie pomieszczenia w każdym stylu.<br /><br /><strong>Do jakich wnętrz pasuje prezentowana lampa?<br /></strong><br />Kinkiet z powodzeniem będzie pełnił funkcje oświetlenia łazienkowego, kuchennego czy biurowego. Dzięki wielu kolorom do wyboru możesz z łatwością tworzyć piękne aranżacje, o jakich marzysz!<br /><br /><strong>Jakie materiały zostały wykorzystane do produkcji kinkietu ściennego?<br /></strong><br />Lampa w całości wykonana jest z trwałego metalu, dzięki czemu oświetlenie posłuży Twoim wnętrzom przez długi czas. Kinkiet może być zasilany wieloma źródłami zasilania, na przykład żarówkami LED lub energooszczędnymi.</p>',NULL,'lampa-kinkiet-edison-loft',NULL,NULL,NULL,'Lampa Kinkiet Edison Loft',NULL,NULL,NULL,NULL),
('2','1','1','<p><strong>Lampa 1 – płomienna metalowa kula<br /></strong><br />Oryginalny, ale prosty styl lampy wiszącej sprawiają, że Twoje wnętrza będą wyglądać zniewalająco. Oświetlenie świetnie uzupełni każdą aranżację.<br /><br /><strong>Gdzie zawiesić prezentowaną lampę wiszącą?<br /></strong><br />Zastosowań nowoczesnej lampy jest całe mnóstwo. Może ona być oświetleniem kuchennym, biurowym czy pokojowym. Metaliczny połysk lampy sufitowej sprawia, że świetnie komponuje się ze wszystkimi kolorami wnętrz.<br /><br /><strong>Z czego wykonana jest lampa wisząca?</strong><br /><br />Oświetlenie zostało w całości stworzone z metalu, przez co jest wyjątkowo trwałe i wytrzymałe. Wnętrze klosza jest białe. Lampa posiada także możliwość regulacji wysokości, aby mogła idealnie dopasować się do każdego wymiaru pomieszczenia. Oświetlenie jest zasilane wieloma rodzajami światła, na przykład żarówkami ledowymi.</p>','BALL 18 1407/1','lampa-wiszaca-pojedyncza-kula-chrom',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Kula Chrom',NULL,NULL,NULL,NULL),
('3','1','1','<p><strong>Lampa wiszące kule chrom <br /></strong><br />Oryginalny i zachwycający design lampy sufitowej wprowadzi mnóstwo nowoczesności do Twoich wnętrz. Trzy wiszące kule z powodzeniem ozdobią wnętrza w każdym stylu – od awangardowych po klasyczne.<br /><br /><strong>W jakich pomieszczeniach najlepiej sprawdzi się nasza 3 - płomienna lampa?<br /></strong><br />Oświetlenie sufitowe będzie znakomicie prezentować się w kuchni, jadalni, pokoju czy gabinecie. Metaliczny kolor pasuje do wszystkich innych barw. Chcesz osiągnąć wyjątkowy i niepowtarzalny design w swoich wnętrzach? Unikatowa lampa z wiszącymi kulami z pewnością pomoże Ci skomponować wymarzoną aranżację.<br /><br /><strong>Jakie zalety posiada nasza lampa wisząca?<br /></strong><br />Oświetlenie zostało wykonane z metalu, dzięki czemu masz gwarancję wytrzymałości i trwałości. Wysokość lampy wiszącej jest regulowana, przez co możesz sam decydować, jak ma wyglądać oświetlenie Twojego wnętrza. Dodatkowo lampa posiada możliwość zasilania jej żarówkami LED oraz posiada opcję podłączenia pod podwójny przełącznik.</p>','BALL 18 1407/3/L','lampa-wiszaca-chromowane-kule',NULL,NULL,NULL,'Lampa Wisząca Chromowane Kule',NULL,NULL,NULL,NULL),
('4','1','1','<p align=\"left\"><strong>Lampa wisząca metalowa 3 źródła zasilania</strong></p>','BALL 18 1407/3','nowoczesna-lampa-wiszaca-kule-chrom',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Kule Chrom',NULL,NULL,NULL,NULL),
('5','1','1','<p><strong>Lampa wisząca w stylu retro</strong><br /><br />Minimalistyczny styl w połączeniu z nowoczesnym designem i klasycznymi kolorami dają lampę wiszącą, która będzie jedyną w swoim rodzaju ozdobą Twoich wnętrz.</p>',NULL,'oryginalna-lampa-wiszaca-loft-retro-edison',NULL,NULL,NULL,'Oryginalna Lampa Wisząca Loft Retro Edison',NULL,NULL,NULL,NULL),
('6','1','1','<p><strong>Oryginalna lampa sufitowa plafon owal</strong></p>',NULL,'lampa-sufitowa-plafon-aluminiowy-nowoczesny',NULL,NULL,NULL,'Lampa Sufitowa Plafon Aluminiowy Nowoczesny',NULL,NULL,NULL,NULL),
('7','1','1','<p><strong>Metalowy kinkiet lampa ścienna <br /></strong><br />Elegancki wygląd kinkietu nada Twoim wnętrzom oryginalnego i niepowtarzalnego klimatu. Faliste łączenia oraz metaliczny kolor lampy czynią ją wyjątkową i pasującą do każdego stylu pomieszczenia.<br /><br /><strong>Gdzie najlepiej prezentuje się metalowy kinkiet?<br /></strong><br />Kuchnia, salon, sypialnia, biuro czy łazienka – lampa będzie pasować do każdego pomieszczenia. Kinkiet łączy w sobie nowoczesny i jednocześnie elegancki design. To właśnie dzięki temu lampa ścienna świetnie prezentuje się we wszystkich wnętrzach.<br /><br /><strong>Jakie materiały zostały użyte do produkcji kinkietu?<br /></strong><br />Konstrukcja lampy została wykonana z metalu, co czyni ją trwałą i odporną na uszkodzenia. Klosz natomiast jest szklany. Lampa jest także bardzo funkcjonalna, dzięki możliwości podłączenia pod podwójny przełącznik. Kinkiet może być zasilany żarówkami LED, energooszczędnymi i wieloma innymi.</p>','DORIKA 1165/K','stylowy-kinkiet-chrom',NULL,NULL,NULL,'Stylowy Kinkiet Chrom',NULL,NULL,NULL,NULL),
('8','1','1','<p><strong>Lampa stojąca trójnóg z abażurem</strong><br /><br />Elegancka i stylowa propozycja lampy stojącej, która będzie rewelacyjnie ozdabiać Twoje wnętrza oraz stanie się niezwykle funkcjonalnym oświetleniem.</p>',NULL,'lampa-stojaca-z-abazurem-trojnog-podlogowa',NULL,NULL,NULL,'Lampa Stojąca z Abażurem Trójnóg Podłogowa',NULL,NULL,NULL,NULL),
('9','1','1','<p><strong>Lampa wisząca kula 1 źródło zasilania metal<br /></strong><br />Klasyczny, a zarazem elegancki styl lampy wiszącej doda Twoim wnętrzom nowoczesności i wyjątkowego klimatu. <br /><br /><strong>Gdzie zawiesić prezentowaną lampę?<br /></strong><br />Żyrandol świetnie sprawdzi się zarówno w kuchni jak i pokoju, biurze czy salonie. Ponadczasowy design lampy sufitowej z powodzeniem dopasuje się do każdego pomieszczenia. Oświetlenie zostało stworzone w klasycznych kolorach kloszy aby nadać lampie wiszącej oryginalności i wyjątkowości.<br /><br /><strong>Jakie materiały zostały użyte do produkcji oświetlenia?<br /></strong><br />Lampa jest w całości wykonana z trwałego i odpornego na uszkodzenia metalu. Żyrandol posiada regulowaną wysokość, dzięki czemu dopasuje się do każdego rozmiaru pomieszczenia. Ponadto lampa posiada wiele źródeł zasilania, na przykład żarówki ledowe lub energooszczędne.</p>',NULL,'pojedyncza-lampa-wiszaca-kula-metalowa',NULL,NULL,NULL,'Pojedyncza Lampa Wisząca Kula Metalowa',NULL,NULL,NULL,NULL),
