('21','1','1','<p><strong>Metalowa Lampa wisząca wiele kolorów <br /></strong><br />Prosta, ale elegancka lampa wprowadzi mnóstwo nowoczesności i wyjątkowego klimatu do Twoich wnętrz. Do wyboru kolor biały lub czarny, dzięki czemu z łatwością dobierzesz lampę idealnie pasującą do Twojego stylu.<br /><br /><strong>Gdzie najlepiej prezentuje się lampa wisząca?<br /></strong><br />Dzięki klasycznemu stylowi lampy pasuje ona do wielu pomieszczeń. Może pełnić funkcje oświetlenia kuchennego, pokojowego, biurowego czy salonowego. Lampa w stonowanych kolorach fantastycznie skontrastuje wnętrze o jasnych, intensywnych barwach.<br /><br /><strong>Z jakich materiałów została stworzona nowoczesna lampa?<br /></strong><br />Oświetlenie sufitowe zostało w całości wykonane z metalu, dzięki czemu masz pewność, że lampa będzie pełnić swoją funkcję przez bardzo długi czas. Dodatkowo lampa posiada możliwość regulacji wysokości, przez co idealnie dopasujesz ją do każdego rozmiaru pomieszczenia. Żyrandol posiada wiele opcji zasilania, w tym oświetlenie LED.</p>',NULL,'kolorowa-lampa-wiszaca-metalowa',NULL,NULL,NULL,'Kolorowa Lampa Wisząca Metalowa',NULL,NULL,NULL,NULL),
('22','1','1','<p><strong>Pojedyncza lampa wisząca w industrialnym stylu</strong></p>',NULL,'nowoczesna-lampa-wiszaca-loft-rozne-klosze',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Loft Różne Klosze',NULL,NULL,NULL,NULL),
('23','1','1','<p><strong>Lampa wisząca z dwoma źródłami światła w stylu retro</strong></p>',NULL,'nowoczesna-lampa-wiszaca-loft-retro',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Loft Retro',NULL,NULL,NULL,NULL),
('24','1','1','<p><strong>Lampa wisząca 3-płomienna Edison Loft</strong></p>',NULL,'oryginalna-lampa-wiszaca-industrialna-loft',NULL,NULL,NULL,'Oryginalna Lampa Wisząca Industrialna Loft',NULL,NULL,NULL,NULL),
('25','1','1','<p><strong>Metalowa lampa kinkiet kula chrom <br /></strong><br />Nowoczesny i ponadczasowy design kinkietu sprawi, że Twoje wnętrza będą zachwycać wyjątkowym stylem. Metaliczny połysk lampy będzie idealnie komponował się z każda aranżacją.<br /><br /><strong>Do jakich wnętrz pasuje nowoczesna lampa?<br /></strong><br />Oświetlenie będzie świetną lampą do biura, kuchni, salonu czy jadalni. Kombinacji, jakie można stworzyć z lampą ścienną, jest całe mnóstwo. A to wszystko dzięki jej uniwersalnej barwie, która dopasowuje się do każdego stylu – od nowoczesnych po klasyczne wnętrza.<br /><br /><strong>Jakie zalety posiada prezentowana lampa?<br /></strong><br />Oświetlenie sufitowe wykonane jest z metalu w powłoce chromowej, dzięki czemu jest bardzo wytrzymałe. Kinkiet może być zasilany różnymi rodzajami światła, na przykład żarówkami LED.</p>','BALL 18 1407/K','kinkiet-loft-kula-chrom',NULL,NULL,NULL,'Kinkiet Loft Kula Chrom',NULL,NULL,NULL,NULL),
('26','1','1','<p><strong>Wisząca lampa w stylu skandynawskim <br /></strong><br />Marzysz o nowoczesnym designie i maksymalnym rozświetleniu swoich wnętrz? Nasza lampa w skandynawskim stylu pomoże Ci stworzyć oryginalną i zachwycającą aranżację!<br /><br /><strong>Do jakich pomieszczeń pasuje prezentowane oświetlenie?<br /></strong><br />Lampa rewelacyjnie ozdobi Twój salon, kuchnię, jadalnię czy pokój. Dzięki klasycznym kolorom żyrandol idealnie wpasuje się w każdy styl pomieszczenia – od nowoczesnego po aranżacje retro. Klosz został stworzony na wzór klatki, co wprowadzi do Twojego wnętrza mnóstwo światła.<br /><br /><strong>Jakie zalety posiada oryginalny żyrandol?<br /></strong><br />Lampa sufitowa została w całości wykonana z metalu, przez co jest trwała i odporna na uszkodzenia. Oświetlanie posiada także możliwość regulacji wysokości, dzięki czemu idealnie dopasuje się do wnętrz wysokich jak i niskich. Lampa może być zasilana wieloma rodzajami żarówek, między innymi oświetleniem ledowym lub energooszczędnym.</p>',NULL,'lampa-loft-w-stylu-skandynawskim',NULL,NULL,NULL,'Lampa Loft w Stylu Skandynawskim',NULL,NULL,NULL,NULL),
('27','1','1','<p><strong>Lampa wisząca kule plafon 2 – płomienna sufitowa na belce </strong></p>','BALL 18 1408/2','lampa-sufitowa-chromowana-plafon-kule',NULL,NULL,NULL,'Lampa Sufitowa Chromowana Plafon Kule',NULL,NULL,NULL,NULL),
('28','1','1','<p><strong>Elegancka lampa wisząca z abażurem<br /></strong><br />Klasyczny design lampy doda uroku wszystkim pomieszczeniem, także tym, stworzonym w nowoczesnym stylu. Stonowane kolory świetnie wpasują się w każdą aranżację.<br /><br /><strong>Do jakich wnętrz pasuje prezentowana lampa wisząca?<br /></strong><br />Kuchnia, pokój dziecięcy, kawiarnia czy sypialnia – oryginalna lampa nada wyjątkowemu klimatu wielu pomieszczeniom. Jasne i klasyczne kolory rewelacyjnie skontrastują jaskrawe wnętrza, a także będą świetnie współgrać ze stonowanymi barwami.<br /><br /><strong>Z czego została wykonana lampa wisząca?<br /></strong><br />Do produkcji konstrukcji oświetlenia wykorzystano trwały metal, a abażur wykonany jest z materiału. Lampa posiada bardzo funkcjonalną opcję – możliwość regulowania wysokości, co pozwala na dopasowanie żyrandola do każdego wymiaru pomieszczenia. Dodatkowo oświetlenie pełni także rolę lampy LED.</p>',NULL,'lampa-wiszaca-abazur-chrom-wiele-kolorow',NULL,NULL,NULL,'Lampa Wisząca Abażur Chrom Wiele Kolorów',NULL,NULL,NULL,NULL),
('29','1','1','<p><strong>Stylowa lampa wisząca 3-płomienna Edison Loft miedź</strong><br /><br />Jeśli szukasz funkcjonalnego oświetlenia, pełniącego również rolę nowoczesnej i eleganckiej ozdoby dla Twojej aranżacji, to mamy lampę wiszącą idealną dla Ciebie! Minimalistyczny design oraz trzy źródła światła czynią ją takim oświetleniem wiszącym, jakiego szukasz.</p>','FUSION 1546/3','nowoczesna-lampa-loft-wiszaca-retro',NULL,NULL,NULL,'Nowoczesna Lampa Loft Wisząca Retro',NULL,NULL,NULL,NULL),
('30','1','1','<p><strong>Lampa ścienna kinkiet w stylu loft dwa kolory</strong></p>',NULL,'kinkiet-industrialny-miedz-lampa-na-sciane',NULL,NULL,NULL,'Kinkiet Industrialny Miedź Lampa na Ścianę',NULL,NULL,NULL,NULL),
('31','1','1','<p><strong>Kinkiet ścienny metalowa oprawa kula różne kolory<br /></strong><br />Szukasz oświetlenia, które nada Twoim wnętrzom oryginalnego i nowoczesnego designu? Dobrze trafiłeś! Nasz kinkiet w kształcie kuli z powodzeniem ozdobi pomieszczenia zaprojektowane w każdym stylu. <br /><br /><strong>Gdzie najlepiej prezentuje się lampa ścienna?<br /></strong><br />Kinkiet łazienkowy, kuchenny czy biurowy – to tylko kilka z mnóstwa zastosowań naszej nowoczesnej lampy. Oświetlenie zostało stworzone w wielu kolorach, aby dopasowanie go do stylu Twojego pomieszczenia było jeszcze łatwiejsze.<br /><br /><strong>Jakie tworzywa zostały wykorzystane do produkcji kinkietu ściennego?<br /></strong><br />Całość lampy wykonana jest z wytrzymałego metalu. Lampa posiada także możliwość regulacji kąta światła, co jest niezwykle przydatną i funkcjonalną opcją. Kinkiet może być zasilany oświetleniem ledowym.</p>',NULL,'kinkiet-kula-regulowany-rozne-kolory',NULL,NULL,NULL,'Kinkiet Kula Regulowany Różne Kolory',NULL,NULL,NULL,NULL),
