('60','1','1','<p><strong>Lampa wisząca chrom 3-płomienna ze szklanymi kloszami<br /><br /></strong>Klasyczna i elegancka lampa, która wspaniale ozdobi Twoje wnętrza. Metal w powłoce chromowej ze szklanymi kloszami tworzą niezwykłe efektowne połączenie o ponadczasowym stylu.</p>','DASTI 1346/3','lampa-wiszaca-sufitowa-chrom-szklane-klosze',NULL,NULL,NULL,'Lampa Wisząca Sufitowa Chrom Szklane Klosze',NULL,NULL,NULL,NULL),
