('63','1','1','<p><strong>Lampa sufitowa 3 – płomienna plafon klosze do wyboru <br /></strong><br />Elegancja i oryginalność zawarte w jednej lampie! Unikatowy design oświetlenia sufitowego pozwala na stworzenie wielu wyjątkowych aranżacji.<br /><br /><strong>Do jakich wnętrze pasuje prezentowany żyrandol?<br /></strong><br />Oświetlenie będzie idealną lampą do salonu, sypialni, jadalni czy biura. Ciemny brąz doda Twoim wnętrzom elegancji, a satynowa konstrukcja świetnie ożywi każde pomieszczenie.<br /><br /><strong>Jakie zalety posiada plafon?<br /></strong><br />Klosze lampy wiszącej osadzone są na przegubach, co pozwala na dowolną regulację kąta padania światła. Stelaż żyrandola wykonany jest z metalu, dzięki czemu oświetlenie jest trwałe i wytrzymałe. Wszystkie klosze do lampy są szklane. Lampa posiada wiele źródeł zasilania, na przykład żarówki ledowe lub energooszczędne.</p>',NULL,'stylowa-lampa-sufitowa-klosze-do-wyboru-zyrandol',NULL,NULL,NULL,'Stylowa Lampa Sufitowa Klosze do Wyboru Żyrandol',NULL,NULL,NULL,NULL),
('64','1','1','<p><strong>Stylowa lampa wisząca 3 – punktowa klosze do wyboru<br /></strong><br />Szukasz lampy sufitowej, która doda Twoim wnętrzom elegancji i wyjątkowego klimatu? Mamy coś w sam raz dla Ciebie! Klasyczny design lampy idealnie dopasuje się do każdej aranżacji i stylu pomieszczenia.<br /><br /><strong>Gdzie zawiesić prezentowany plafon?<br /></strong><br />Lampa będzie idealnym oświetleniem do salonu, jadalni, sypialni czy biura. Ciekawa konstrukcja żyrandola została stworzona w trzech uniwersalnych kolorach, aby jak najlepiej dopasować oświetlenie do charakteru pomieszczenia. Ponadto wiele kloszy do lampy pozwala na stworzenie własnego, unikatowego plafonu.<br /><br /><strong>Czy lampa wisząca jest funkcjonalna?<br /></strong><br />Oczywiście, że tak! Klosze lampy osadzone są na przegubach, co pozwala na dowolną regulację kąta padania światła. Ponadto konstrukcja oświetlenia wykonana jest z trwałego i wytrzymałego metalu. Klosze do lampy wiszącej są szklane. Plafon może być zasilany wieloma rodzajami światła, na przykład żarówkami ledowymi.</p>',NULL,'klasyczna-lampa-z-chromowanymi-elementami-trzy-kolory',NULL,NULL,NULL,'Klasyczna Lampa z Chromowanymi Elementami Trzy Kolory',NULL,NULL,NULL,NULL),
('65','1','1','<p><strong>Metalowa lampa wisząca 3 – płomienna różne kolory<br /></strong><br />Oryginalny design lampy sufitowej wprowadzi do Twoich wnętrz mnóstwo nowoczesności. Dzięki wielu kolorom do wyboru stworzysz własną, niepowtarzalną aranżację.<br /><br /><strong>Do jakich wnętrz pasuje prezentowana lampa?<br /></strong><br />Oświetlenie będzie idealną lampą do kuchni, salonu, pokoju czy biura. Żyrandol nie posiada kloszy, dzięki czemu jest wyjątkowy i doda każdemu wnętrzu wiele uroku. Żywe kolory lampy wiszącej doskonale ożywią jasne i klasyczne pomieszczenia. Natomiast żyrandol w bardziej stonowanych barwach doda elegancji Twoim wnętrzom.<br /><br /><strong>Jakie zalety posiada nowoczesna lampa?<br /></strong><br />Żyrandol oprócz niepowtarzalnego wyglądu, posiada również wiele innych atutów. Konstrukcja lampy sufitowej wykonana jest z metalu, co daje gwarancję wytrzymałości i trwałości oświetlenia. Lampa posiada także możliwość podłączenia pod podwójny przełącznik. Z racji tego, że lampa nie posiada kloszy, można zasilać ją wieloma rodzajami żarówek, na przykład ledowymi lub energooszczędnymi.</p>',NULL,'kolorowa-lampa-wiszaca-edison-loft',NULL,NULL,NULL,'Kolorowa Lampa Wisząca Edison Loft',NULL,NULL,NULL,NULL),
('66','1','1','<p><strong>Lampa wisząca plafon 3 źródła światła<br /></strong><br />Klasyczny design lampy sufitowej rewelacyjnie uzupełni Twoją aranżację, nadając jej elegancji i nowoczesności. Dwa kolory podsufitki pozwolą Ci na idealne dopasowanie lampy do Twojego stylu.<br /><br /><strong>Do jakich wnętrz pasuje prezentowany plafon?<br /></strong><br />Lampa wisząca świetnie sprawdzi się w wielu pomieszczeniach – w kuchni, salonie, sypialni czy biurze. Dzięki klasycznemu designowi lampa świetnie dopasowuje się do wszystkich wnętrz. Biały kolor podsufitki znakomicie ożywi ciemne pomieszczenia, a czarny stelaż lampy sufitowej rewelacyjnie skontrastuje wnętrza urządzone w jasnych, żywych barwach.<br /><br /><strong>Czy lampa wisząca jest funkcjonalna?<br /></strong><br />O praktyczności oświetlenia sufitowego świadczy możliwość regulacji kloszy pod pod dowolnym kątem. Dzięki tej funkcji możesz skierować światło w wygodny dla siebie sposób. Konstrukcja oświetlenia stworzona jest wytrzymałego metalu, a klosze do lampy wykonane są z odpornego na uszkodzenia szkła. Ponadto oświetlenie może być zasilane wieloma rodzajami światła, na przykład żarówkami LED.</p>',NULL,'lampa-sufitowa-na-listwie-chromowanymi-elementami',NULL,NULL,NULL,'Lampa Sufitowa na Listwie Chromowanymi Elementami',NULL,NULL,NULL,NULL),
('67','1','1','<p><strong>Lampa wisząca z abażurem dwa wzory do wyboru<br /></strong><br />Oryginalne wzory abażurów wprowadzą do Twoich wnętrz niepowtarzalnego klimatu. Dzięki możliwości wybraniu koloru linki stworzysz oświetlenie idealnie pasujące do Twojego stylu.<br /><br /><strong>Gdzie zawiesić prezentowaną lampę sufitową?<br /></strong><br />Oświetlenie może pełnić rolę lampy do kuchni, pokoju, sypialni czy nawet kawiarni lub restauracji. Delikatne wzory i barwy abażurów sprawiają, że lampa pasuje do wnętrz urządzonych zarówno w jasnych jak i ciemnych kolorach.<br /><br /><strong>Jakie materiały zostały wykorzystane do produkcji oświetlenia sufitowego?<br /></strong><br />Linki i podsufitka wykonane są z metalu, co daje gwarancję trwałości i wytrzymałości. Natomiast klosz lampy jest materiałowy. Oświetlenie jest także bardzo funkcjonale, ponieważ posiada możliwość regulacji wysokości. Ponadto lampa może być zasilana wieloma rodzajami światła, w tym oświetleniem ledowym.</p>',NULL,'lampa-wiszaca-abazur-w-kwiaty',NULL,NULL,NULL,'Lampa Wisząca Abażur w Kwiaty',NULL,NULL,NULL,NULL),
('68','1','1','<p><strong>Lampa wisząca w oplocie 3 źródła światła <br /></strong><br />Nowoczesny i pomysłowy design lampy sufitowej nada Twoim wnętrzom niepowtarzalnego charakteru. Linki w oplocie jak i brak kloszy czynią oświetlenie oryginalnym i wyjątkowym. <br /><br /><strong>Do jakich wnętrz pasuje prezentowana lampa?<br /></strong><br />Lampa doskonale sprawdzi się w kuchni, sypialni, pokoju czy jadalni. Wiele kolorów linek do wyboru oraz dwie barwy podsufitki pozwolą Ci stworzyć własną, nowatorską lampę wiszącą. Oświetlenie będzie przykuwało uwagę swoim charakterystycznym wyglądem.<br /><br /><strong>Jakie zalety posiada nowoczesna lampa?<br /></strong><br />Podsufitka oświetlenia sufitowego wykonana jest z metalu w powłoce chromowej lub miedziowanej, co zapewni Ci użyteczność lampy na bardzo długi czas. Możesz wybrać wielu spośród możliwych do założenia żarówek – ledowe, energooszczędne w zależności od tego, jak ma wyglądać Twoja niesamowita lampa.</p>',NULL,'lampa-wiszaca-oplot-loft-zarowki',NULL,NULL,NULL,'Lampa Wisząca Oplot Loft Żarówki',NULL,NULL,NULL,NULL),
('69','1','1','<p><strong>Lampa sufitowa 2 źródła zasilania metal<br /></strong><br />Prosty, lecz oryginalny design żyrandola doda nowoczesności Twoim wnętrzom. Plafon znakomicie ozdobi jak i rozświetli każdą aranżację.<br /><br /><strong>Do jakich wnętrz pasuje nowoczesna lampa?<br /></strong><br />Żyrandol może pełnić rolę oświetlenia kuchennego, pokojowego, biurowego czy salonowego. Metaliczny połysk i eleganckie klosze sprawiają, że lampa dopasuje się do każdego stylu – od nowoczesnego po klasyczny.<br /><br /><strong>Czy prezentowany plafon jest funkcjonalny?<br /></strong><br />Oczywiście, że tak! Lampa sufitowa posiada możliwość podłączenia pod podwójny przełącznik, dzięki czemu regulować ilością świateł w wygodny dla Ciebie sposób. Konstrukcja plafonu wykonana jest wytrzymałego metalu, a klosze do lampy są szklane. Oświetlenie jest także plafonem ledowym.</p>','CANIS 1351/2','lampa-wiszaca-sufitowa-chrom-elegancka',NULL,NULL,NULL,'Lampa Wisząca Sufitowa Chrom Elegancka',NULL,NULL,NULL,NULL),
('70','1','1','<p>Szukasz funkcjonalnej <a href=\"/21-lampy-wiszace\">lampy wiszącej</a> o ponadczasowym wyglądzie? Mamy oświetlenie idealne dla Ciebie. Chromowana konstrukcja i eleganckie szklane klosze tworzą lampę, która rewelacyjnie komponuje się z każdym wystrojem wnętrz.<br /><br /></p>',NULL,'elegancka-lampa-wiszaca-chrom-szklane-klosze-we-wzory',NULL,NULL,NULL,'Elegancka Lampa Wisząca Chrom Szklane Klosze we Wzory',NULL,NULL,NULL,NULL),
('71','1','1','<p><strong>Lampa sufitowa 3 – płomienna klosze do wyboru<br /></strong><br />Klasyczny i elegancki design lampy sufitowej sprawią, że Twoje wnętrza nabiorą wyjątkowego charakteru. Wybierz trzy spośród wielu niesamowitych kloszy i zachwycaj niepowtarzalną aranżacją.<br /><br /><strong>Do jakich wnętrz pasuje prezentowany plafon?<br /></strong><br />Lampa świetnie ozdobi Twój salon, pokój, gabinet czy biuro. Żyrandol może zawiesić w każdym pomieszczeniu, ponieważ fantastycznie dopasowuje się do wnętrz urządzonych w dowolnym stylu – od nowoczesny po klasyczny.<br /><br /><strong>Jakie zalety posiada lampa wisząca?<br /></strong><br />Metalowa konstrukcja z chromowanymi elementami to ewidentny atut lampy, ponieważ dzięki użyciu tych materiałów jest niezwykle trwała i wytrzymała. Klosze są stworzone z odpornego na uszkodzenia szkła. Plafon posiada wiele opcji zasilania, w tym oświetlenie ledowe lub energooszczędne.</p>',NULL,'lampa-sufitowa-z-chromowanymi-elementami-szklane-klosze',NULL,NULL,NULL,'Lampa Sufitowa z chromowanymi Elementami Szklane Klosze',NULL,NULL,NULL,NULL),
('72','1','1','<p align=\"left\"><strong>Lampa sufitowa plafon 2 – płomienna klosze do wyboru<br /></strong><br />Nowoczesny i elegancki styl lampy wiszącej świetnie ozdobi Twoje wnętrze. Ciekawa i oryginalna konstrukcja plafonu przykuwa uwagę i prezentuje się zjawiskowo w każdym pomieszczeniu.<br /><br /><strong>Gdzie zawiesić 2 – punktową lampę sufitową?<br /></strong><br />Plafon może pełnić rolę oświetlenia kuchennego, pokojowego czy biurowego. Lampa fantastycznie dopasowuje się do pomieszczeń urządzonych w każdym stylu – od nowoczesne po klasyczne aranżacje. <br /><br /><strong>Czy prezentowana lampa jest funkcjonalna?</strong><br />Klosze żyrandola osadzone są na przegubach, dzięki czemu możesz dowolnie regulować kąt padania światła. Metalowa konstrukcja lampy sufitowej zapewni Ci trwałość i wytrzymałość, a szklane klosze odporność na uszkodzenia. Dodatkowo oświetlenie pełni również funkcję plafonu LED.</p>',NULL,'nowoczesna-lampa-sufitowa-plafon-chrom',NULL,NULL,NULL,'Nowoczesna Lampa Sufitowa Plafon Chrom',NULL,NULL,NULL,NULL),
('73','1','1','<p><strong>Klasyczna lampa sufitowa 2 źródła zasilania<br /></strong><br />Prosty, lecz elegancki design lampy wiszącej zapewni Twoim wnętrzom oryginalny i zachwycający wygląd, bez względu na styl, w jakim urządzone jest pomieszczenie.<br /><br /><strong>Do jakich wnętrz najlepiej pasuje lampa sufitowa?<br /></strong><br />Oświetlenie będzie znakomitą lampą do kuchni, biura, salonu czy sypialni. Klasyczny styl świetnie prezentuje się w każdym pomieszczeniu. Ciemna konstrukcja lampy wiszącej doda wnętrzu elegancji, a biały stelaż ożywi i skontrastuje ciemne pomieszczenia.<br /><br /><strong>Czy prezentowany plafon jest funkcjonalny?<br /></strong><br />Oczywiście, że tak! Klosze lampy osadzone są na przegubach, co pozwala na regulację kąta padania światła w dowolny sposób. Ponadto materiały użyte do produkcji lampy są wytrzymałe i odporne na uszkodzenia. Oświetlenie zasilane jest wieloma rodzajami światła, na przykład żarówkami LED lub energooszczędnymi.</p>',NULL,'klasyczna-lampa-sufitowa-przegub-chrom',NULL,NULL,NULL,'Klasyczna Lampa Sufitowa Przegub Chrom',NULL,NULL,NULL,NULL),
('74','1','1','<p><strong>Elegancka lampa wisząca 2 – płomienna z chromowanymi elementami<br /></strong><br />Oryginalna i awangardowa konstrukcja lampy sufitowej urozmaici Twoje wnętrza. Wyjątkowy wygląd oświetlenie świetnie skomponuje się z każdym stylem pomieszczenia – od nowoczesnego po klasyczny.<br /><br /><strong>Do jakich wnętrz pasuje prezentowana lampa sufitowa?</strong><br /><br />Oświetlenie będzie idealną lampą do kuchni, salonu, pokoju czy sypialni. Brązowy stelaż fenomenalnie odnajdzie się w klasycznych aranżacjach urządzonych zarówno w jasnych jak i ciemnych kolorach. Satynowa konstrukcja lampy wiszącej rewelacyjnie wygląda w pomieszczeniach kuchennych bądź jadalnych, nadając im elegancji.<br /><br /><strong>Czy 2 – płomienna lampa jest funkcjonalna?<br /></strong><br />Solidne materiały wykorzystane do produkcji lampy zapewnią Ci radość z jej użytkowania na bardzo długi czas. Ponadto wiele szklanych kloszy do wyboru pozwala na stworzenie własnego, oryginalnego wyglądu lampy. Oświetlenie może być zasilane wieloma rodzajami światła, na przykład żarówkami ledowymi.</p>',NULL,'stylowa-lampa-wiszaca-rozne-klosze-zyrandol',NULL,NULL,NULL,'Stylowa Lampa Wisząca Różne Klosze Żyrandol',NULL,NULL,NULL,NULL),
('75','1','1','<p><strong>Lampa wisząca z abażurem<br /></strong><br />Elegancki i oryginalny styl lampy wiszącej nada Twoim wnętrzom wyjątkowego klimatu. Klasyczne kolory kloszy sprawiają, ze pomieszczenie wygląda stylowo i wytwornie.<br /><br /><strong>Gdzie zawiesić prezentowaną lampę sufitową?<br /></strong><br />Oświetlenie może zdobić Twoją kuchnię, salon, sypialnię, pokój czy biuro. Dzięki możliwości wybrania koloru linki oraz abażura idealnie dopasujesz lampę wiszącą do każdego rodzaju pomieszczenia.<br /><br /><strong>Jakie zalety posiada lampa sufitowa?<br /></strong><br />Konstrukcja oświetlenia wykonana jest metalu, dzięki czemu jest trwała i odporna na uszkodzenia. Abażur jest materiałowy. Ponadto lampa posiada możliwość regulacji wysokości, przez co dostosuje się do każdego wymiaru pomieszczenia. Oświetlenie pełni również funkcję lampy LED.</p>',NULL,'lampa-wiszaca-z-podwojnym-abazurem',NULL,NULL,NULL,'Lampa Wisząca z Podwójnym Abażurem',NULL,NULL,NULL,NULL),
('76','1','1','<p><strong>Lampa sufitowa 3 – punktowa metalowe kule <br /></strong><br />Prosty, ale nowatorski design lampy wiszącej nada Twoim wnętrzom elegancji i wyjątkowości. Metalowe kule w klasycznych kolorach idealnie uzupełnią każdą aranżację.<br /><br /><strong>Do jakich wnętrz pasuje prezentowany plafon?<br /></strong><br />Lampa sufitowa wspaniale ozdobi Twoją kuchnię, biuro, pokój czy salon. Stonowane kolory świetnie odnajdą się w pomieszczeniach urządzonych zarówno w jasnych jak i ciemnych barwach.<br /><br /><strong>Jakie zalety posiada nowoczesna lampa wisząca?<br /></strong><br />Plafon posiada możliwość regulacji kąta padania światła, dzięki czemu możesz rozstawić klosze lampy w wygodny dla siebie sposób. Oświetlenie sufitowe stworzone jest z wytrzymałego i odpornego na uszkodzenia metalu. Dodatkowo plafon jest także lampą LED.</p>',NULL,'stylowa-lampa-sufitowa-kule-metalowa',NULL,NULL,NULL,'Stylowa Lampa Sufitowa Kule Metalowa',NULL,NULL,NULL,NULL),
('77','1','1','<p><strong>Lampa wisząca 2 – płomienna szklane klosze do wyboru <br /></strong><br />Oryginalny i ponadczasowej design lampy wiszącej sprawi, że Twoje wnętrza nabiorą nowego, niepowtarzalnego stylu.<br /><br /><strong>Gdzie najlepiej prezentuje się elegancki plafon?<br /></strong><br />Lampa wspaniale ozdobi Twój salon, pokój, biuro czy sypialnię. Dwa kolory konstrukcji oraz możliwość wybrania klosza pozwolą Ci stworzyć unikatowe oświetlenie, które idealnie odda charakter Twojego pomieszczenia.<br /><br /><strong>Czy prezentowana lampa sufitowa jest funkcjonalna?<br /></strong><br />Oczywiście, że tak! Klosze lampy osadzone są na przegubach, co pozwala na regulację kąta padania światła. Ponadto metalowa konstrukcja żyrandola pozwoli Ci cieszyć się oświetleniem przez bardzo długi czas. Plafon może być zasilany wieloma rodzajami światła, na przykład żarówkami LED.</p>',NULL,'lampa-sufitowa-plafon-z-chromowanymi-elementami',NULL,NULL,NULL,'Lampa Sufitowa Plafon z Chromowanymi Elementami',NULL,NULL,NULL,NULL),
('78','1','1','<p><strong>Lampa sufitowa 2 źródła światła plafon <br /></strong><br />Klasyczny i elegancki design lampy wiszącej pozwolą Ci stworzyć oryginalną aranżację. Dwa kolory konstrukcji do wyboru umożliwiają idealne dopasowanie lampy do pomieszczenia.<br /><br /><strong>Do jakich wnętrz pasuje nowoczesny plafon?<br /></strong><br />Lampa będzie fantastyczną ozdobą Twojej kuchni, salonu, pokoju czy biura. Ciemna konstrukcja lampy świetnie skontrastuje jasne wnętrza. Biały stelaż plafonu wspaniale odnajdzie się w ciemnych, klasycznych pomieszczeniach.<br /><br /><strong>Jakie zalety posiada prezentowany żyrandol?<br /></strong><br />Klosze lampy wiszącej osadzone są na przegubach, co pozwala regulację kąta padania światła. Konstrukcja oświetlenia sufitowego stworzona jest z wytrzymałego metalu, a klosze wykonane są z odpornego na uszkodzenia szkła. Dodatkowe lampa pełni także rolę plafonu LED.</p>',NULL,'nowoczesna-lampa-sufitowa-na-listwie-plafon',NULL,NULL,NULL,'Nowoczesna Lampa Sufitowa na Listwie Plafon',NULL,NULL,NULL,NULL),
('79','1','1','<p><strong>2 – punktowa lampa wisząca klosze do wyboru <br /></strong><br />Elegancki styl lampy sufitowej nada Twoim niepowtarzalny klimat. Oryginalna konstrukcja w połączeniu z pięknymi kloszami dają lampę idealnie dopasowującą się do każdej aranżacji.<br /><br /><strong>Do jakich wnętrz pasuje prezentowany plafon?<br /></strong><br />Lampa może pełnić rolę zarówno oświetlenia kuchennego jak i pokojowego czy salonowego. Dzięki dwóm kolorom konstrukcji (brąz i satyna) idealnie dopasujesz lampę do stylu Twojego pomieszczenia. Dodatkowo wiele kloszy do wyboru pozwala na stworzenia własnego, niepowtarzalnego oświetlenia.<br /><br /><strong>Z czego wykonana jest lampa wisząca?<br /></strong><br />Stelaż żyrandola wykonany jest z wytrzymałego metalu, a klosze do lampy są szklane. Oświetlenie pełni również rolę lampy ledowej.</p>',NULL,'lampa-z-chromowanymi-elementami-zyrandol-plafon',NULL,NULL,NULL,'Lampa z Chromowanymi Elementami Żyrandol Plafon',NULL,NULL,NULL,NULL),
('80','1','1','<p><strong>Elegancka lampa wisząca z abażurem wiele kolorów <br /></strong><br />Klasyczna i stylowa lampa sufitowa, która świetnie wpasuje się do każdej aranżacji. Materiałowy abażur stworzony jest w kilku kolorach, aby z łatwością wkomponować lampę do swojego wnętrza.<br /><br /><strong>Gdzie najlepiej prezentuje się oświetlenie sufitowe?<br /></strong><br />Lampa może pełnić funkcje oświetlenia do kuchni, salonu, pokoju czy biura. Klasyczny design i unikalne kolory abażurów oraz linek tworzę lampę pasującą do każdego pomieszczenia.<br /><br /><strong>Jakie zalety posiada prezentowana lampa wisząca?<br /></strong><br />Konstrukcja żyrandola została stworzona z trwałego i odpornego na uszkodzenia metalu. Natomiast abażur wykonany jest z solidnego materiału. Atutem lampy jest możliwość regulacji wysokości, dzięki czemu żyrandol dopasowuje się do każdego rozmiaru pomieszczenia. Oświetlenie jest także lampą LED.</p>',NULL,'lampa-wiszaca-z-abazurem-linki-do-wyboru',NULL,NULL,NULL,'Lampa Wisząca z Abażurem Linki do Wyboru',NULL,NULL,NULL,NULL),
('81','1','1','<p><strong>Lampa sufitowa 2 – płomienna plafon metalowe kule<br /></strong><br />Nowoczesny design lampy wiszącej wprowadzi wyjątkowego klimatu do Twoich wnętrz. Dwie metalowe kule będą wspaniale uzupełniać aranżację zaprojektowaną w każdym stylu – od nowoczesnej po klasyczną.<br /><br /><strong>Gdzie zawiesić prezentowany plafon?<br /></strong><br />Lampa może pełnić rolę oświetlenia kuchennego, pokojowego, biurowego czy łazienkowego. Klasyczne i stonowane kolory, w jakich została stworzony plafon, sprawiają, że idealnie wpasowuje się w każde wnętrze.<br /><br /><strong>Czy lampa sufitowa jest funkcjonalna?<br /></strong><br />Plafon posiada wiele pożytecznych funkcji, takich jak regulacja kąta światła lub możliwość podłączenia pod podwójny przełącznik. Lampa wykonana jest z trwałego i odpornego na uszkodzenia metalu. Ponadto oświetlenie posiada wiele opcji zasilania, na przykład żarówkami ledowymi.</p>',NULL,'lampa-sufitowa-kule-metalowa-przegub',NULL,NULL,NULL,'Lampa Sufitowa Kule Metalowa Przegub',NULL,NULL,NULL,NULL),
('82','1','1','<p><strong>Lampa dziecięca wisząca z abażurem w dziewczynki<br /></strong><br />Szukasz lampy, która w oryginalny sposób ozdobi pokój dziecięcy? Mamy coś dla Ciebie! Kolorowy i ciekawy wzór zapewni niepowtarzalny wygląd i nada pomieszczeniu wyjątkowego klimatu.<br /><br /><strong>Do jakich wnętrz pasuje prezentowana lampa wisząca?<br /></strong><br />Oświetlenie będzie wspaniale prezentować się w pokoju dziecięcym, przedszkolu czy pokoju zabaw. Bajkowy motyw na abażurze znakomicie oddaje charakter pomieszczenia oraz spodoba się każdej małej dziewczynce.<br /><br /><strong>Jakie zalety posiada oryginalna lampa sufitowa?<br /></strong><br />Żyrandol posiada możliwość regulacji wysokości, dzięki czemu z łatwością dopasujesz lampę do pomieszczenia o dowolnym rozmiarze. Oświetlenie wykonane jest z wysokiej jakości tworzyw sztucznych. Lampa zasilana jest popularnymi żarówkami z gwintem E27.</p>',NULL,'lampa-wiszaca-z-abazurem-dzieciece-wzory',NULL,NULL,NULL,'Lampa Wisząca z Abażurem Dziecięce Wzory',NULL,NULL,NULL,NULL),
('83','1','1','<p><strong>Lampa wisząca z abażurem w abstrakcyjny wzór<br /></strong><br />Niebanalny i oryginalny wzór lampy sufitowej nada wyjątkowego klimatu każdemu wnętrzu. Od dziś możesz stworzyć własną, niepowtarzalną aranżację.<br /><br /><strong>Gdzie zawiesić nowoczesną lampę wiszącą?<br /></strong><br />Oświetlenie będzie znakomicie prezentować się w salonie, kuchni, jadalni czy też kawiarni albo restauracji. Może także pełnić funkcje oświetlenia pokojowego. To od Ciebie zależy, jaki styl pomieszczenia stworzysz.<br /><br /><strong>Jakie zalety posiada żyrandol?<br /></strong><br />Lampa posiada wiele funkcjonalnych zalet – możliwość regulacji wysokości oraz trzy kolory linek do wyboru to tylko kilka z nich. Lampa wykonana jest z wysokiej jakości tworzyw sztucznych, abyś mógł cieszyć się oryginalnym oświetleniem przez wiele lat. Żyrandol zasilany jest żarówkami E27.</p>',NULL,'lampa-wiszaca-z-abazurem-abstrakcyjny-wzor',NULL,NULL,NULL,'Lampa Wisząca z Abażurem Abstrakcyjny Wzór',NULL,NULL,NULL,NULL),
('84','1','1','<p><strong>Lampa sufitowa abażur we wzory<br /></strong><br />Wyjątkowy i abstrakcyjny styl lampy wiszącej sprawi, że stanie się ona wspaniałą ozdobą Twojego wnętrza. Wzór abażura świetnie odda charakter Twojego pomieszczenia. Zachwycisz bliskich nowoczesną aranżacją!<br /><br /><strong>Gdzie zawiesić prezentowaną lampę wiszącą?<br /></strong><br />Lampa świetnie sprawdzi się zarówno w kuchni jak i pokoju, biurze, salonie czy nawet łazience. Czarno-biały wzór abażura z łatwością dopasujesz do wystroju swojego pomieszczenia. Trzy kolory linek do wyboru również pozwolą Ci na stworzenie własnej, niepowtarzalnej lampy.<br /><br /><strong>Czy lampa wisząca jest funkcjonalna?<br /></strong><br />Oczywiście, że tak! Oświetlenie sufitowe posiada możliwość regulacji wysokości, co pozwala mu na dopasowanie się do każdego pomieszczenia. Lampa wykonana jest z trwałych i odpornych na uszkodzenia materiałów. Ponadto żyrandol zasilany jest żarówkami E27, na przykład oświetleniem LED.</p>',NULL,'lampa-wiszaca-abazur-chevron-zygzak-zwis',NULL,NULL,NULL,'Lampa Wisząca Abażur Chevron Zygzak Zwis',NULL,NULL,NULL,NULL),
('85','1','1','<p><strong>Lampa wisząca abażur w piłki pokój dziecięcy<br /></strong><br />Szukasz oryginalnej lampy wiszącej, która ozdobi pokój Twoje dziecka? Mamy coś specjalnie dla ciebie! Abażur w piłki świetnie odda charakter dziecięcego pomieszczenia.<br /><br /><strong>Gdzie zawiesić prezentowaną lampę sufitową?<br /></strong><br />Żyrandol świetnie ozdobi przedszkole, pokój dziecięcy czy pokój zabaw. Abażur z motywem piłek do nogi oraz cztery kolory linek do wyboru pozwolą Ci stworzyć niepowtarzalną lampę idealnie pasującą do Twojej aranżacji.<br /><br /><strong>Jakie zalety posiada lampa wisząca?<br /></strong><br />Oświetlenie posiada możliwość regulacji wysokości, dzięki czemu doskonale wpasowuje się w każde pomieszczenie. Żyrandol zasilany jest żarówkami E27. Możesz wybrać zwykłe, LED lub dekoraycjne.</p>',NULL,'lampa-wiszaca-abazur-dzieciece-wzory',NULL,NULL,NULL,'Lampa Wisząca Abażur Dziecięce Wzory',NULL,NULL,NULL,NULL),
('86','1','1','<p><strong>Lampa kuchenna wisząca z abażurem w cytryny<br /></strong><br />Efektowny motyw cytryn na abażurze lampy wiszącej urozmaica i nadaje wyjątkowego klimatu Twojemu pomieszczeniu.<br /><br /><strong>Gdzie zawiesić nowoczesną lampę?<br /></strong><br />Oświetlenie znakomicie sprawdzi się w kuchni, jadalni czy kawiarni. Barwne cytryny grafiki świetnie oddadzą charakter tych pomieszczeń. Linki lampy dostępne są w trzech różnych kolorach, aby stworzenie oświetlenia idealnie odpowiadającego Twoim oczekiwaniom było jeszcze prostsze.<br /><br /><strong>Jakie zalety posiada prezentowana lampa sufitowa?<br /></strong><br />Oświetlenie ma możliwość regulacji wysokości, przez co idealnie dopasujesz lampę do każdego rozmiaru pomieszczenia. Wysokiej jakości tworzywa użyte do produkcji lampy gwarantują jej trwałość i odporność na uszkodzenia. Oświetlenie zasilane jest żarówkami E27.</p>',NULL,'lampa-wiszaca-abazur-do-kuchni',NULL,NULL,NULL,'Lampa Wisząca Abażur do Kuchni',NULL,NULL,NULL,NULL),
('87','1','1','<p><strong>Kinkiet lampa sufitowa plafon<br /></strong><br />Minimalistyczny i elegancki styl lampy sufitowej wprowadzą mnóstwo świeżości i wyjątkowości do Twoich wnętrz. Funkcjonalność kinkietu czyni go odpowiednim do wielu rodzajów pomieszczeń.<br /><br /><strong>Do jakich wnętrz pasuje nowoczesny plafon?<br /></strong><br />Lampa może zawisnąć w takich pomieszczeniach, jak salon, kuchnia, łazienka, biuro czy pokój sypialny. Dzięki klasycznym kolorom konstrukcji kinkiet świetnie prezentuje się w każdej aranżacji – od nowoczesnych po retro.<br /><br /><strong>Czy prezentowana lampa jest funkcjonalna?<br /></strong><br />Oczywiście, że tak! Kinkiet może pełnić rolę zarówno oświetlenia ściennego jak i sufitowego. Ponadto klosz lampy można regulować pod dowolnym kątem i kierunkiem. Plafon wykonany jest z wytrzymałego metalu. Lampa posiada również wiele opcji zasilania, na przykład oświetlenie LED.</p>',NULL,'klasyczny-kinkiet-przegub-czarny-bialy',NULL,NULL,NULL,'Klasyczny Kinkiet Przegub Czarny Biały',NULL,NULL,NULL,NULL),
('88','1','1','<p><strong>Kinkiet lampa ścienna z chromowanymi elementami<br /></strong><br />Lampa, która w wyjątkowy sposób rozświetli Twoje wnętrza, wprowadzając do nich elegancję i oryginalny design.<br /><br /><strong>Do jakich wnętrz pasuje prezentowany kinkiet?<br /></strong><br />Lampa może pełnić funkcje oświetlenia kuchennego, łazienkowego czy biurowego. Możliwości jest nieskończenie wiele, dzięki dużej ilości kloszy, jakie można zamontować w naszej lampie ściennej. Dodatkowo dwa kolory konstrukcji (brąz lub satyna) ułatwią Ci dobór kinkietu najbardziej wpasowujący się w Twoją aranżację.<br /><br /><strong>Czy oświetlenie jest funkcjonalne?<br /></strong><br />Dużym atutem prezentowanego kinkietu jest możliwość regulacji kąta światła pod dowolnym kierunkiem. Metalowa konstrukcja daje gwarancję wytrzymałości i odporności. Ponadto lampa może być zasilana wieloma źródłami światła, na przykład żarówkami LED.</p>',NULL,'klasyczny-kinkiet-chrom',NULL,NULL,NULL,'Klasyczny Kinkiet Chrom',NULL,NULL,NULL,NULL),
('89','1','1','<p><strong>Kinkiet ze szklanym kloszem</strong></p>',NULL,'kinkiet-z-chromowanymi-elementami-szklany-klosz',NULL,NULL,NULL,'Kinkiet z Chromowanymi Elementami Szklany Klosz',NULL,NULL,NULL,NULL),
('90','1','1','<p><strong>Elegancki kinkiet z chromowanymi elementami klosze do wyboru<br /></strong><br />Funkcjonalna i nowoczesna lampa, która doda Twoim pomieszczeniom stylowości i oryginalności. Stwórz niepowtarzalne oświetlenie z kloszem, który sam wybierzesz!<br /><br /><strong>Do jakich wnętrz pasuje prezentowany kinkiet?<br /></strong><br />Lampa z powodzeniem rozświetli Twoją kuchnię, jadalnię, sypialnię czy biuro. Dzięki możliwości wyboru klosza oraz koloru podsufitki, kinkiet będzie wspaniale prezentował w pomieszczeniach stworzonych w każdym stylu – od nowoczesnych po klasyczne. <br /><br /><strong>Czy oświetlenie sufitowe jest funkcjonalne?<br /></strong><br />Oczywiście, że tak! Kinkiet może pełnić rolę oświetlenia sufitowego jak i ściennego. Możliwość regulacji kąta światła oraz solidne materiały wykorzystane do produkcji lampy czynią ją praktyczną i niepowtarzalną. Kinkiet posiada także wiele opcji zasilania – żarówki LED, energooszczędne i inne.</p>',NULL,'kinkiet-chrom-regulowany-szklany-klosz',NULL,NULL,NULL,'Kinkiet Chrom Regulowany Szklany Klosz',NULL,NULL,NULL,NULL),
