('211','1','1','<p><strong>Lampa 1 – płomienna metalowa kula<br /></strong><br />Oryginalny, ale prosty styl lampy wiszącej sprawiają, że Twoje wnętrza będą wyglądać zniewalająco. Oświetlenie świetnie uzupełni każdą aranżację.<br /><br /><strong>Gdzie zawiesić prezentowaną lampę wiszącą?<br /></strong><br />Zastosowań nowoczesnej lampy jest całe mnóstwo. Może ona być oświetleniem kuchennym, biurowym czy pokojowym. Metaliczny połysk lampy sufitowej sprawia, że świetnie komponuje się ze wszystkimi kolorami wnętrz.<br /><br /><strong>Z czego wykonana jest lampa wisząca?</strong><br /><br />Oświetlenie zostało w całości stworzone z metalu, przez co jest wyjątkowo trwałe i wytrzymałe. Wnętrze klosza jest białe. Lampa posiada także możliwość regulacji wysokości, aby mogła idealnie dopasować się do każdego wymiaru pomieszczenia. Oświetlenie jest zasilane wieloma rodzajami światła, na przykład żarówkami ledowymi.</p>','BALL 18 1407/1','lampa-wiszaca-pojedyncza-kula-chrom',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Kula Chrom',NULL,NULL,NULL,NULL),
