('220','1','1','<p>Wprowadź do sowich wnętrz nowoczesność! Prezentowana lampa wisząca wspaniale uatrakcyjni Twoje wnętrza, czyniąc je stylowymi i niepowtarzalnymi. Wybierz kolory linek i wzory kloszy najbardziej oddające charakter Twojego pomieszczenia i ciesz się zachwycającą aranżacją wnętrz.</p>',NULL,'nowoczesna-loftowa-lampa-wiszaca-regulowana-typu-pajak',NULL,NULL,NULL,'Nowoczesna Loftowa Lampa Wisząca Regulowana Typu Pająk',NULL,NULL,NULL,NULL),
