('223','1','1','<p>Plafon stworzony w minimalistycznym stylu, który doda Twoim wnętrzom oryginalności i blasku. Klosze o niepowtarzalnym kształcie czynią lampę odpowiednią do nowoczesnych jak i klasycznych pomieszczeń.<br /><br /></p>',NULL,'lampa-sufitowa-na-listwie-regulowana-nowoczesna',NULL,NULL,NULL,'Lampa Sufitowa na Listwie Regulowana Nowoczesna',NULL,NULL,NULL,NULL),
('224','1','1','<p>Chcesz dodać swoim wnętrzom nowoczesności i niepowtarzalnego wyglądu? Lampa sufitowa z trzema designerskimi kloszami pomoże Ci zbudować magiczny nastrój w pomieszczeniu.<br /><br /></p>',NULL,'lampa-sufitowa-nowoczesna-zyrandol-led',NULL,NULL,NULL,'Lampa Sufitowa Nowoczesna Żyrandol LED',NULL,NULL,NULL,NULL),
('225','1','1','<p>Niezwykle designerska lampa, która pasuje zarówno do wnętrz nowoczesnych jak i klasycznych. Minimalistyczny styl oświetlenia stanie zachwycającą dekoracją Twoich wnętrz.<br /><br /></p>',NULL,'lampa-sufitowa-metalowa-wiszaca-nowoczesna',NULL,NULL,NULL,'Lampa Sufitowa Metalowa Wisząca Nowoczesna',NULL,NULL,NULL,NULL),
('226','1','1','<p>Przekonaj się, jak stylową ozdobą pomieszczenia może zostać lampa! Kinkiet znakomicie komponuje się z wnętrzami w stylu nowoczesnym, retro, klasycznym czy industrialnym.<br /><br /></p>',NULL,'stylowy-kinkiet-lampa-scienna-metal-trzy-kolory',NULL,NULL,NULL,'Stylowy Kinkiet Lampa Ścienna Metal Trzy Kolory',NULL,NULL,NULL,NULL),
('227','1','1','<p>Wprowadź do swoich wnętrz nowoczesność i elegancję. Lampa sufitowa fantastycznie udekoruje Twoje wnętrza, nadając im niepowtarzalnego nastroju.<br /><br /></p>','TORI 2010/2/L','lampa-sufitowa-nowoczesna-czarna-ruchoma',NULL,NULL,NULL,'Lampa Sufitowa Nowoczesna Czarna Ruchoma',NULL,NULL,NULL,NULL),
('228','1','1','<p>Klasyczny rodzaj lampy sufitowej, którego wygląd przykuwa spojrzenia i czyni wnętrza niepowtarzalnymi. Minimalistyczny design plafonu świetnie komponuje się ze wszystkimi stylami wnętrz.<br /><br /></p>','TORI 2010/3/L','czarna-lampa-sufitowa-nowoczesna-plafon-led',NULL,NULL,NULL,'Czarna Lampa Sufitowa Nowoczesna Plafon LED',NULL,NULL,NULL,NULL),
('229','1','1','<p>Oświetl swoje wnętrza lampą, która będzie oryginalną dekoracją Twoich wnętrz. Nowoczesna, minimalistyczna lampa sufitowa nie tylko dokładnie oświetli całe pomieszczenie. Swoim designem sprawi, że Twoja wnętrza staną przytulne, stylowa i eleganckie.<br /><br /></p>','TORI 2010/4/KP','lampa-sufitowa-zyrandol-nowoczesny-regulacja-kloszy',NULL,NULL,NULL,'Lampa Sufitowa Żyrandol Nowoczesny Regulacja Kloszy',NULL,NULL,NULL,NULL),
('230','1','1','<p>Designerskie oświetlenie, które uczyni Twoje wnętrza niepowtarzalnymi. Oryginalny wygląd klosza, chromowana podsufitka i czarny kolor dodadzą pomieszczeniu elegancji i nowoczesności.<br /><br /></p>','TORI 2010/KP','nowoczesny-kinkiet-czarny-chrom-lampa-na-sciane',NULL,NULL,NULL,'Nowoczesny Kinkiet Czarny Chrom Lampa na Ścianę',NULL,NULL,NULL,NULL),
('231','1','1','<p>Funkcjonalne i stylowe oświetlenie, które stanie się główną dekoracją Twojego mieszkania. Minimalistyczny, designerski wygląd klosza uczyni wnętrza niepowtarzalnymi.<br /><br /></p>','TORI 2010/P','lampa-plafon-kinkiet-ruchomy-stylowy',NULL,NULL,NULL,'Lampa Plafon Kinkiet Ruchomy Stylowy',NULL,NULL,NULL,NULL),
('232','1','1','<p>Regulowana lampa wisząca to nie tylko funkcjonalne oświetlenie. Lampa swoim wyglądem doda wnętrzom niepowtarzalnego i wyjątkowego klimatu. Oświetlenie pasuje do wnętrz w stylu loft jaki i nowoczesnym.<br /><br /></p>','EDISON 1502/3/OW','lampa-w-stylu-loft-nowoczesna-klosze-metal',NULL,NULL,NULL,'Lampa w Stylu Loft Nowoczesna Klosze Metal',NULL,NULL,NULL,NULL),
('233','1','1','<p>Jak dodać wnętrzom oryginalności i stylowego wyglądu? Niepowtarzalną lampą wiszącą. Lampa z materiałowym abażurem w designerskie liście i koronkę doda pomieszczeniu nowoczesności i przytulnego klimatu.<br /><br /></p>',NULL,'lampa-wiszaca-abazur-material-liscie-koronka',NULL,NULL,NULL,'Lampa Wisząca Abażur Materiał Liście Koronka',NULL,NULL,NULL,NULL),
('234','1','1','<p>Lampa wisząca z abażurem stanie się oryginalną dekoracją Twoich wnętrz. Abażur w zielone liście pasuje do pomieszczeń w stylu nowoczesnym, a klosz z białą koronką świetnie prezentuje się również w nieco bardziej klasycznych aranżacjach.<br /><br /></p>',NULL,'lampa-wiszaca-abazur-okragly-liscie-koronka-pojedyncza',NULL,NULL,NULL,'Lampa Wisząca Abażur Okrągły Liście Koronka Pojedyncza',NULL,NULL,NULL,NULL),
('235','1','1','<p>Lampa wisząca, która doda przytulności i podkreśli wesoły charakter pokoju Twojego dziecka. Abażury w z motywem uroczych niedźwiadków i zebr spodobają się wszystkim maluszkom.<br /><br /></p>',NULL,'lampa-wiszaca-z-abazurem-dzieciece-wzory',NULL,NULL,NULL,'Lampa Wisząca z Abażurem Dziecięce Wzory',NULL,NULL,NULL,NULL),
('236','1','1','<p>Lampa wisząca spodoba się wszystkim, którzy cenią sobie oryginalność i nowoczesność we wnętrzach. Metalowa lampa loft swoim ciekawym designem przyciąga spojrzenia oraz uczyni pomieszczenie niepowtarzalnym.<br /><br /></p>',NULL,'lampa-wiszaca-sufitowa-loft-zwis-metalowa-e27-drut',NULL,NULL,NULL,'Lampa Wisząca Sufitowa Loft Zwis Metalowa E27 drut',NULL,NULL,NULL,NULL),
('237','1','1','<p>Lampa, która wspaniale podkreśli indywidualność Twojego dziecka. Dziesięć kolorów abażura oraz pięć kolorów konstrukcji do wyboru umożliwia stworzenie własnej, niepowtarzalnej lampy idealnie pasującą do wystroju pokoju.</p>',NULL,'lampa-sufitowa-diament-dziecieca-kolorowa',NULL,NULL,NULL,'Lampa Sufitowa Diament Dziecięca Kolorowa',NULL,NULL,NULL,NULL),
('238','1','1','<p>Designerskie oświetlenie, które nada pomieszczeniu nowoczesnego i jednocześnie przytulnego charakteru. Wiele kolorów konstrukcji i abażurów do wyboru pozwala na idealne dopasowanie lampy nocnej do wystroju wnętrz.<br /><br /></p>',NULL,'lampka-nocna-nowoczesna-abazur-diament-loft',NULL,NULL,NULL,'Lampka Nocna Nowoczesna Abażur Diament Loft',NULL,NULL,NULL,NULL),
('239','1','1','<p>Stylowa lampka na stół lub szafkę nocną, która zachwyca swoim designem. Prosta konstrukcja i materiałowy, stożkowy abażur tworzą połączenie, które pasuje do nowoczesnych, klasycznych wnętrz jak i wystrojów w stylu skandynawskim.<br /><br /></p>',NULL,'nowoczesna-lampka-nocna-stolowa-trojnog-do-sypialni',NULL,NULL,NULL,'Nowoczesna Lampka Nocna Stołowa Trójnóg do Sypialni',NULL,NULL,NULL,NULL),
('240','1','1','<p>Lampka nocna, która podkreśli charakter Twoich wnętrz i doda im przytulności. Lampa stołowa została wykonana w wielu wersjach kolorystycznych, byś mógł idealnie dopasować ją do aranżacji pomieszczenia.<br /><br /></p>',NULL,'stylowa-lampka-nocna-biurkowa-abazur-diament',NULL,NULL,NULL,'Stylowa Lampka Nocna Biurkowa Abażur Diament',NULL,NULL,NULL,NULL),
('241','1','1','<p>Lampa 2-płomienna zachowana jest w stylu industrialnym, jednak świetnie odnajduje się również w nowoczesnych, minimalistycznych czy skandynawskich designach. Oświetlenie stworzyliśmy w dwóch uniwersalnych kolorach, dzięki czemu pasuje do każdego wystroju pomieszczenia.<br /><br /></p>',NULL,'lampa-wiszaca-loft-metalowa-klosze-dekoracyjne',NULL,NULL,NULL,'Lampa Wisząca Loft Metalowa Klosze Dekoracyjne',NULL,NULL,NULL,NULL),
('242','1','1','<p>Chcesz nadać swoim wnętrzom nowoczesności? A może szukasz lampy do minimalistycznego wystroju pokoju? Mamy dla Ciebie idealne oświetlenie, które pasować będzie do każdego z pomieszczeń.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-loft-diament-metal-dwa-kolory',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Loft Diament Metal Dwa Kolory',NULL,NULL,NULL,NULL),
('243','1','1','<p>Niezwykłe połączenie klasyki z nowoczesnym designem. Lampa wisząca z okrągłym abażurem została urozmaicona nowoczesną dekoracją z metalu. Ten niewielki element nadał lampie zupełnie nowego klimatu czyniąc ją odpowiednią zarówno do nowoczesnych, minimalistycznych jak i klasycznych wnętrz.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-z-abazurem-metalowa-dekoracja',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca z Abażurem Metalowa Dekoracja',NULL,NULL,NULL,NULL),
('244','1','1','<p>Prezentowana lampa wisząca uzupełni minimalistyczny wystrój wnętrz, doda nowoczesności klasycznym wystrojom oraz idealnie skomponuje się z industrialnymi mieszkaniami. Prosty, a zarazem oryginalny design oświetlenia pasuje do wszystkich aranżacji wnętrz.<br /><br /></p>',NULL,'lampa-industrialna-regulowana-metalowa-wiszaca',NULL,NULL,NULL,'Lampa Industrialna Regulowana Metalowa Wisząca',NULL,NULL,NULL,NULL),
('245','1','1','<p>Niezwykła lampka nocna, która jest połączeniem kilku stylów – nowoczesnego, industrialnego i klasycznego. Dzięki temu oświetlenie znakomicie komponuje się z większością aranżacji wnętrz. Lampa stołowa posiada trzy kolory konstrukcji oraz cztery wzory abażura do wyboru, dzięki czemu z łatwością dobierzesz oświetlenie oddające charakter Twoich wnętrz.</p>',NULL,'lampka-nocna-loft-do-sypialni-abazur-stozek',NULL,NULL,NULL,'Lampka Nocna Loft do Sypialni Abażur Stożek',NULL,NULL,NULL,NULL),
('246','1','1','<p>Designerska lampa wisząca, która pasuje do każdego rodzaju pomieszczenia. Wygląda minimalistycznie, a materiałowy abażur przełamuje styl oświetlenia i czyni wnętrza niezwykle przytulnymi.<br /><br /></p>',NULL,'lampa-wiszaca-z-abazurem-kolorowa-nowoczesna',NULL,NULL,NULL,'Lampa Wisząca z Abażurem Kolorowa Nowoczesna',NULL,NULL,NULL,NULL),
('247','1','1','<p>Prezentowana lampa spodoba się fanom klasyki w nowoczesnym wydaniu. Okrągły abażur z materiału i minimalistyczna linka z regulacją wysokości tworzą oświetlenie, które pasuje do każdego rodzaju wnętrza i prezentuje się niezwykle designersko.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-duzy-abazur',NULL,NULL,NULL,'Nowoczesna Lampa wisząca Duży Abażur',NULL,NULL,NULL,NULL),
('248','1','1','<p>Lampa, która idealnie podkreśli radosny charakter pokoju dziecka. Dziesięć kolorów abażura do wyboru umożliwia skomponowanie oświetlenia dopasowanego do stylu pomieszczenia.</p>',NULL,'lampa-wiszaca-dziecieca-abazury-diament-kolorowe',NULL,NULL,NULL,'Lampa Wisząca Dziecięca Abażury Diament Kolorowe',NULL,NULL,NULL,NULL),
('249','1','1','<p>Designerska lampa wisząca, która doda oryginalności każdemu pomieszczeniu. Klasyczna czerń doskonale komponuje się ze wszystkimi stylami wnętrza. Klosz odsłaniający żarówkę doda magii i blasku Twojemu mieszkaniu.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-styl-loft-czarna',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Styl Loft Czarna',NULL,NULL,NULL,NULL),
('250','1','1','<p>Lampa, która doda Twoim wnętrzom oryginalności i nowoczesności. Minimalistyczny, a zarazem przykuwający spojrzenia wygląd lampy ozdobi Twoją sypialnię, salon, kuchnię, jadalnię i wiele innych pomieszczeń.<br /><br /></p>','NUVOLA 2034/1/M','lampa-pojedyncza-wiszaca-w-stylu-loft-nowoczesna',NULL,NULL,NULL,'Lampa Pojedyncza Wisząca w Stylu Loft Nowoczesna',NULL,NULL,NULL,NULL),
('251','1','1','<p>Stylowe oświetlenie, które w oryginalny sposób udekoruje Twoje wnętrze. Designerski klosz o nieregularnym kształcie sprawia, że <a href=\"/21-lampy-wiszace\">lampa wisząca</a> przykuwa spojrzenia.<br /><br /></p>','NUVOLA 2034/1/L','designerska-lampa-wiszaca-loft-metalowa-czarna',NULL,NULL,NULL,'Designerska Lampa Wisząca Loft Metalowa Czarna',NULL,NULL,NULL,NULL),
('252','1','1','<p>Niezwykła <a href=\"/34-lampy-z-abazurami\">lampa z abażurem</a>, która zachwyca wyjątkowym wyglądem oraz funkcjonalnością. Abażur oświetlenia został wykonany w bardzo efektowny sposób – przypomina kartkę z zeszytu z wesołymi rysunkami najmłodszych. Ta koncepcja spodoba się naszym maluchom oraz świetnie dopasuje się do każdego wystroju pokoju dziecka.<br /><br /></p>','DIAMOND 1500/1/K','lampa-wiszaca-dla-dzieci-pojedyncza-z-abazurem',NULL,NULL,NULL,'Lampa Wisząca dla Dzieci Pojedyncza z Abażurem',NULL,NULL,NULL,NULL),
('253','1','1','<p>Niezwykła <a href=\"/25-lampy-wiszace-z-abazurami\">lampa wisząca z abażurem</a>, która przyprawi o uśmiech nie tylko najmłodszych. Klosze oświetlenia wyglądem przypominają kartkę z zeszytu, na której widnieją urocze rysunki maluchów. Dodatkową dekoracją pokoju dziecka będzie diamentowy kształt abażurów.<br /><br /></p>','DIAMOND 1500/2L/K','lampa-wiszaca-do-pokoju-dziecka-abazury-we-wzory',NULL,NULL,NULL,'Lampa Wisząca do Pokoju Dziecka Abażury we Wzory',NULL,NULL,NULL,NULL),
('254','1','1','<p>Funkcjonalna i oryginalna <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która doda jeszcze więcej radości do pokoju dziecka. Abażury w kształcie diamentu przypominają kartkę z zeszytu, na której widzimy zabawne rysunki naszych maluchów. <a href=\"/74-lampy-dzieciece\">Lampa dziecięca</a> spodoba się zarówno chłopcu jak i dziewczynce oraz znakomicie dopasuje się do kolorów panujących w pokoju.<br /><br /></p>','DIAMOND 1500/3L/K','lampa-wiszaca-dziecieca-sufitowa-abazury-regulacja',NULL,NULL,NULL,'Lampa Wisząca Dziecięca Sufitowa Abażury Regulacja',NULL,NULL,NULL,NULL),
('255','1','1','<p>Wprowadź do pokoju swojego malucha więcej radości i wesołych akcentów. <a href=\"/25-lampy-wiszace-z-abazurami\">Lampa wisząca z abażurami</a> w dziecięce rysunki świetnie Ci w tym pomoże. Żyrandol spodoba się chłopcom, dziewczynkom oraz przyprawi o uśmiech niejednego dorosłego.<br /><br /></p>','DIAMOND 1500/3OW/K','lampa-wiszaca-zyrandol-dzieciecy-abazury-we-wzory',NULL,NULL,NULL,'Lampa Wisząca Żyrandol Dziecięcy Abażury we Wzory',NULL,NULL,NULL,NULL),
('256','1','1','<p>Nowoczesna <a href=\"/72-lampki-stolowe-nocne\">lampka nocna</a> stanie się największą dekoracją pokoju dziecka. Minimalistyczna konstrukcja o ciekawym kształcie w połączeniu z abażurem przypominającym zeszyt z rysunkami dzieci tworzą niezwykle efektowny duet.<br /><br /></p>','DIAMOND 1500/LN/K','lampka-stolowa-nocna-dziecieca-abazur-metal',NULL,NULL,NULL,'Lampka Stołowa Nocna Dziecięca Abażur Metal',NULL,NULL,NULL,NULL),
('257','1','1','<p>Prezentowana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> wywoła uśmiech na twarzy nie tylko u dzieci, ale również u niejednego dorosłego. Dostępne wzory abażurów to urocze, wesołe motywy, które staną się główną dekoracją pokoju dziecięcego.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-dzieciece-wzory-abazurow',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Dziecięce Wzory Abażurów',NULL,NULL,NULL,NULL),
('258','1','1','<p>Niezwykła <a href=\"/53-lampy-sufitowe\">lampa sufitowa</a>, która wprowadzi jeszcze więcej radości do pokoju dziecięcego. <a href=\"/21-lampy-wiszace\">Lampa wisząca</a> posiada trzy kolory konstrukcji i siedem wzorów abażura do wyboru, które możesz dowolnie ze sobą łączyć. Dzięki temu samodzielnie stworzysz oświetlenie najbardziej odpowiadające Twojemu dziecku.<br /><br /></p>',NULL,'lampa-wiszaca-sufitowa-regulowana-dziecieca-abazury',NULL,NULL,NULL,'Lampa Wisząca Sufitowa Regulowana Dziecięca Abażury',NULL,NULL,NULL,NULL),
('259','1','1','<p><a href=\"/74-lampy-dzieciece\">Lampa dziecięca</a> dostępna w pięciu kolorach konstrukcji oraz z siedmioma wzorami abażurów do wyboru. Pozwala to na stworzenie własnej, niepowtarzalnej <a href=\"/53-lampy-sufitowe\">lampy sufitowej</a> idealnie pasującej do wystroju pomieszczenia i trafiającej w gusta dziecka.<br /><br /></p>',NULL,'lampa-sufitowa-dzieciecy-zyrandol-z-abazurami-regulowany',NULL,NULL,NULL,'Lampa Sufitowa Dziecięcy Żyrandol z Abażurami Regulowany',NULL,NULL,NULL,NULL),
('260','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> o klasycznym wyglądzie, która rewelacyjnie prezentuje się również w nowoczesnych wnętrzach. Abażur z ozdobnym pasem jest elegancką, a jednocześnie minimalistyczną dekoracją <a href=\"/61-zwisy-wiszace\">zwisu wiszącego</a>.<br /><br /></p>',NULL,'lampa-wiszaca-z-abazurem-klasyczna-regulowana',NULL,NULL,NULL,'Lampa Wisząca z Abażurem Klasyczna Regulowana',NULL,NULL,NULL,NULL),
('261','1','1','<p>Prezentowana <a href=\"/34-lampy-z-abazurami\">lampa z abażurami</a> znakomicie odnajduje się zarówno w klasycznych wnętrzach jak i minimalistycznych, nowoczesnych aranżacjach. Abażury dostępne są w pięciu kolorach od jasnych do ciemnych odcieni, a konstrukcję oświetlenia mamy w wersji białej, czarnej i szarej.<br /><br /></p>',NULL,'lampa-wiszaca-na-listwie-sufitowa-abazury',NULL,NULL,NULL,'Lampa Wisząca na Listwie Sufitowa Abażury',NULL,NULL,NULL,NULL),
('262','1','1','<p>Klasyczny <a href=\"/19-kinkiety-z-abazurami\">kinkiet z abażurem</a>, który znakomicie wpisuje się również w trendy stylu nowoczesnego. Posiadamy wiele wariantów kolorystycznych abażurów i konstrukcji, dzięki czemu możesz stworzyć oświetlenie idealnie dopasowane do wystroju Twojego mieszkania.<br /><br /></p>',NULL,'nowoczesny-kinkiet-z-abazurem-lampa-na-sciane',NULL,NULL,NULL,'Nowoczesny Kinkiet z Abażurem Lampa na Ścianę',NULL,NULL,NULL,NULL),
('263','1','1','<p>Uniwersalna <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która dopasuje się do każdego wystroju wnętrza. Abażur dostępny jest w różnych połączeniach kolorystycznych, co jeszcze bardziej ułatwia dostosowanie <a href=\"/61-zwisy-wiszace\">zwisu wiszącego</a> do pomieszczenia. Lampa posiada również trzy kolory konstrukcji do wyboru.<br /><br /></p>',NULL,'lampa-wiszaca-sufitowa-z-abazurem-nowoczesna-pojedyncza',NULL,NULL,NULL,'Lampa Wisząca Sufitowa z Abażurem Nowoczesna Pojedyncza',NULL,NULL,NULL,NULL),
('264','1','1','<p>Prezentowana <a href=\"/25-lampy-wiszace-z-abazurami\">lampa wisząca z abażurami</a> stanie się dekoracją każdego rodzaju wnętrza. Stonowane kolory, minimalistyczny, a zarazem niepowtarzalny wygląd lampy sprawiają, że stanie się ona designerskim uzupełnieniem Twoich wnętrz.<br /><br /></p>',NULL,'lampa-wiszaca-zyrandol-regulowana-abazury',NULL,NULL,NULL,'Lampa Wisząca Żyrandol Regulowana Abażury',NULL,NULL,NULL,NULL),
('265','1','1','<p>Prezentujemy <a href=\"/25-lampy-wiszace-z-abazurami\">lampę wiszącą a abażurami</a>, która wspaniale udekoruje pomieszczenia stworzone w nowoczesnym jak i klasycznym stylu. Stonowane warianty kolorystyczne abażurów i konstrukcji sprawiają, że <strong>żyrandol sufitowy</strong> dopasuje się do każdego wystroju wnętrzarskiego.<br /><br /></p>',NULL,'lampa-wiszaca-nowoczesna-na-listwie-abazury-sufitowa',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna na Listwie Abażury Sufitowa',NULL,NULL,NULL,NULL),
('266','1','1','<p><a href=\"/17-kinkiety-nowoczesne\">Nowoczesny kinkiet</a>, który dopasuje się do wystroju Twoich wnętrz. Abażur lampy ściennej dostępny jest pięciu wariantach kolorystycznych oraz z trzema kolorami konstrukcji, dzięki czemu stworzysz kinkiet idealnie oddający piękno Twoich wnętrz.<br /><br /></p>',NULL,'kinkiet-nowoczesny-z-abazurem-wiele-kolorow-lampa',NULL,NULL,NULL,'Kinkiet Nowoczesny z Abażurem Wiele Kolorów Lampa',NULL,NULL,NULL,NULL),
('267','1','1','<p>Szukasz <a href=\"/53-lampy-sufitowe\">lampy sufitowej</a>, która stylowo dopasuje się zarówno do klasycznego jak i nowoczesnego wystroju wnętrz? Mamy <a href=\"/21-lampy-wiszace\">lampę wiszącą</a> idealną dla Ciebie! Minimalistyczna konstrukcja w połączeniu z abażurem w trzech stonowanych kolorach tworzą duet, który komponuje się z każdym stylem wnętrzarskim.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-regulowana-nowoczesna-abazur',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Regulowana Nowoczesna Abażur',NULL,NULL,NULL,NULL),
('268','1','1','<p><a href=\"/34-lampy-z-abazurami\">Lampa z abażurem</a>, która dopasuje się do większości wystrojów pomieszczenia. Minimalistyczna konstrukcja i stonowane kolory abażura tworzą <strong>oświetlenie sufitowe</strong> potrafiące nadać wnętrzom przytulności i elegancji.<br /><br /></p>',NULL,'lampa-regulowana-wiszaca-sufitowa-abazur-material',NULL,NULL,NULL,'Lampa Regulowana Wisząca Sufitowa Abażur Materiał',NULL,NULL,NULL,NULL),
('269','1','1','<p>Niezwykła <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która ozdobi zarówno klasyczne jak i nowoczesne wnętrza. Oświetlenie zaprojektowaliśmy w minimalistycznym stylu, by komponowało się z wieloma rodzajami wnętrz. Do <a href=\"/53-lampy-sufitowe\">lampy sufitowej</a> dodaliśmy przyciągającą wzrok dekorację – prześwitujący fragment abażura, który odsłania żarówkę.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-z-abazurem-zarowka',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca z Abażurem Żarówka',NULL,NULL,NULL,NULL),
('270','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> o nowoczesnym wyglądzie, który pięknie prezentuje się zarówno w minimalistycznych jak i bardziej eleganckich, zdobionych wnętrzach. <strong>Oświetlenie sufitowe</strong> posiada pięć kolorów abażura i trzy kolory konstrukcji do wyboru. Dzięki temu masz możliwość stworzenia takiego zestawienia barw, które najbardziej pasuje do Twojego mieszkania.<br /><br /></p>',NULL,'lampa-wiszaca-sufitowa-abazur-pojedyncza-regulacja',NULL,NULL,NULL,'Lampa Wisząca Sufitowa Abażur Pojedyncza Regulacja',NULL,NULL,NULL,NULL),
('271','1','1','<p>Stylowa <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która świetnie wkomponuje się w wystrój Twoich wnętrz. <a href=\"/70-zwisy-wiszace-pojedyncze-regulowane\">Zwis wiszący pojedynczy regulowany</a> dostępny jest w wielu stonowanych kolorach do wyboru, dzięki czemu pasuje do wszystkich wystrojów pomieszczeń.<br /><br /></p>',NULL,'lampa-z-abazurem-wiszaca-nowoczesna-wiele-kolorow',NULL,NULL,NULL,'Lampa z Abażurem Wisząca Nowoczesna Wiele Kolorów',NULL,NULL,NULL,NULL),
('272','1','1','<p>Szukasz oświetlenia do pokoju dziecka, które będzie funkcjonalne, jednocześnie przypadnie maluchowi do gustu i będzie komponować się z wystrojem pokoju? Mamy <a href=\"/74-lampy-dzieciece\">lampę dziecięcą </a>idealną dla Ciebie! <strong>Oświetlenie sufitowe</strong> jest regulowane, a abażur dostępny jest w wielu pięknych wzorach, wśród których na pewno znajdziesz motyw, który pokocha Twoje dziecko.<br /><br /></p>',NULL,'lampa-wiszaca-dziecieca-abazur-wiele-wzorow',NULL,NULL,NULL,'Lampa Wisząca Dziecięca Abażur Wiele Wzorów',NULL,NULL,NULL,NULL),
('273','1','1','<p>Szukasz <a href=\"/25-lampy-wiszace-z-abazurami\">lampy wiszącej z abażurem</a> w najmodniejsze motywy sezonu, która stanie największą dekoracją Twojego pomieszczenia? Mamy oświetlenie stworzone dla Ciebie! Biała konstrukcja <a href=\"/53-lampy-sufitowe\">lampy sufitowej</a> znakomicie komponuje się z modnymi kloszami. <strong>Posiadamy wzory abażurów we flamingi, kwiaty, tropikalne liście i koronkę. </strong><br /><br /></p>',NULL,'lampa-wiszaca-nowoczesna-modne-abazury',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Modne Abażury',NULL,NULL,NULL,NULL),
('274','1','1','<p>Chcesz nieco urozmaicić swoje wnętrza? Znudził Ci się dotychczasowy wystrój mieszkania? A może urządzasz dom i szukasz modnego wyposażenia? W każdym przypadku niezastąpiona okaże się prezentowana <a href=\"/22-lampy-wiszace-nowoczesne\">lampa wisząca nowoczesna</a>. Oświetlenie posiada cztery niezwykle modne wzory abażurów do wyboru: tropikalne liście, koronka, kolorowe kwiaty, czarno-biała roślinność.<br /><br /></p>',NULL,'lampa-wiszaca-sufitowa-abazur-w-modne-wzory-regulacja',NULL,NULL,NULL,'Lampa Wisząca Sufitowa Abażur w Modne Wzory Regulacja',NULL,NULL,NULL,NULL),
('275','1','1','<p>Prezentowana <a href=\"/34-lampy-z-abazurami\">lampa z abażurem</a> stanie się największą ozdobą wnętrza, które urządzasz. Niezwykłe abażury z tropikalnymi motywami przyciągną spojrzenia oraz rewelacyjnie ożywią wystrój Twojego mieszkania.<br /><br /></p>',NULL,'lampa-wiszaca-z-abazurem-w-tropikalne-wzory-nowoczesna',NULL,NULL,NULL,'Lampa Wisząca z Abażurem w Tropikalne Wzory Nowoczesna',NULL,NULL,NULL,NULL),
('276','1','1','<p>Stylowa <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która pasuje do wielu rodzajów wnętrz. Abażur w modny wzór koronki będzie fantastycznym uzupełnieniem i dekoracją pokoju w nowoczesnym, skandynawskim czy minimalistycznym stylu.<br /><br /></p>','MILU 1940/1/WZ','lampa-wiszaca-nowoczesna-abazur-kwiaty-koronka',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Abażur Kwiaty Koronka',NULL,NULL,NULL,NULL),
('277','1','1','<p>Oryginalna <a href=\"/76-lampy-wiszace-dzieciece\">lampa wisząca dziecięca</a>, która wywoła uśmiech na twarzy Twojej pociechy. Abażur ma kształt diamentu, a jego wzór przedstawia kartkę z zeszytu z wesołymi rysunkami dzieci. Dodatkowo możliwość umocowania linki w dowolnej odległości od podsufitki daje bardzo oryginalny i nowoczesny efekt.<br /><br /></p>','SPIDER 1921/D1/kid','nowoczesna-lampa-dziecieca-z-abazurem-pajak',NULL,NULL,NULL,'Nowoczesna Lampa Dziecięca z Abażurem Pająk',NULL,NULL,NULL,NULL),
('278','1','1','<p>Designerska, a jednocześnie urocza <a href=\"/74-lampy-dzieciece\">lampa dziecięca</a>, która spodoba się zarówno maluchowi jak i dorosłemu oraz idealnie wpasuje się w wystrój urządzanego pokoju. Nietypowe mocowanie <a href=\"/21-lampy-wiszace\">lampy wiszącej</a> sprawia, że oświetlenie wygląda bardzo oryginalnie. Abażury we wzory przedstawiające rysunki dzieci wprowadzą do wnętrza wesoły nastrój.<br /><br /></p>','SPIDER 1921/D2/kid','lampa-wiszaca-do-pokoju-dziecka-abazur-nowoczesna',NULL,NULL,NULL,'Lampa Wisząca do Pokoju Dziecka Abażur Nowoczesna',NULL,NULL,NULL,NULL),
('279','1','1','<p><a href=\"/74-lampy-dzieciece\">Lampa dziecięca</a>, która wygląda niezwykle nowocześnie i designersko. Abażury w pogodne wzory przypominające rysunki dzieci na pewno spodobają się Twojemu maluchowi. Jasna kolorystyka <a href=\"/53-lampy-sufitowe\">lampy sufitowej</a> umożliwia dopasowanie jej do każdego wystroju pokoju dziecięcego.<br /><br /></p>','SPIDER 1921/D3/kid','lampa-wiszaca-zyrandol-z-abazurami-do-pokoju-dziecka',NULL,NULL,NULL,'Lampa Wisząca Żyrandol z Abażurami do Pokoju Dziecka',NULL,NULL,NULL,NULL),
('280','1','1','<p>Niezwykle efektowna i funkcjonalna <a href=\"/21-lampy-wiszace\">lampa wisząca</a> do pokoju dziecka. Abażury są w kształcie diamentu, a wzór przypomina kartkę z zeszytu, na której widnieją kolorowe rysunki maluchów. Efektowne klosze wywołają uśmiech na twarzy zarówno dzieci jak i dorosłych.<br /><br /></p>','SPIDER 1921/D4/kid','lampa-wiszaca-sufitowa-dla-dzieci-zyrandol-z-abazurami',NULL,NULL,NULL,'Lampa Wisząca Sufitowa dla Dzieci Żyrandol z Abażurami',NULL,NULL,NULL,NULL),
('281','1','1','<p>Designerska i praktyczna <a href=\"/74-lampy-dzieciece\">lampa dziecięca</a>, która doda pomieszczeniu wesołego nastroju. Abażury <strong>oświetlenia sufitowego</strong> przedstawiają rysunki dzieci na kratce z zeszytu. Klosze i efektowna konstrukcja <a href=\"/21-lampy-wiszace\">lampy wiszące</a>j uczynią pokój Twojego dziecko niepowtarzalnym.<br /><br /></p>','SPIDER 1921/D5/kid','lampa-wiszaca-pajak-z-abazurami-w-dzieciece-wzory-zyrandol',NULL,NULL,NULL,'Lampa Wisząca Pająk z Abażurami w Dziecięce Wzory Żyrandol',NULL,NULL,NULL,NULL),
('282','1','1','<p><a href=\"/25-lampy-wiszace-z-abazurami\">Lampa wisząca z abażurem</a>, która doda Twoim wnętrzom oryginalności i przytulnego nastroju. Oświetlenie możesz przymocować do sufitu w efektowny sposób dodający pomieszczeniu designerskiego wyglądu. Natomiast materiałowy abażur w kształcie diamentu sprawia, że wnętrze zyskuje nowy, wyjątkowy klimat.<br /><br /></p>',NULL,'lampa-sufitowa-wiszaca-z-abazurem-pojedyncza',NULL,NULL,NULL,'Lampa Sufitowa Wisząca z Abażurem Pojedyncza',NULL,NULL,NULL,NULL),
