('378','1','1','<p>Pora zmienić otaczający Cię wystrój wnętrz! Dodaj sobie nowej energii i patrz z zachwytem na aranżację swojego mieszkania. W jaki sposób możesz to uczynić? Dodaj <strong><a href=\"/25-lampy-wiszace-z-abazurami\">lampę wiszącą z abażurem</a> w kolorowe wzory</strong> do swoich wnętrz.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-pojedyncza-z-kolorowym-abazurem-regulowana',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Pojedyncza z Kolorowym Abażurem Regulowana',NULL,NULL,NULL,NULL),
