('380','1','1','<p>Chcesz odmienić wystrój swoich wnętrz bez wielkiego budżetu? Mamy pomysł na zmianę Twojego mieszkania. Wprowadź do aranżacji nową <a href=\"/21-lampy-wiszace\">lampę wiszącą</a>. Nasza propozycja to <strong>oświetlenie z abażurem w kolorowe wzory,</strong> które znakomicie ożywia minimalistyczne wnętrza i dodaje im uroku.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-abazur-we-wzory-pokoj-dziecka',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Abażur we Wzory Pokój Dziecka',NULL,NULL,NULL,NULL),
('381','1','1','<p>Lubisz nowoczesny styl? Jesteś fanem nieszablonowych, ale pięknych rozwiązań we wnętrzach? A może po prostu masz ochotę odmienić coś w swojej aranżacji mieszkania? W każdym z tych przypadków idealnie sprawdza się nasza <a href=\"/25-lampy-wiszace-z-abazurami\">lampa wisząca z abażurem</a> w kolorowe wzory!<br /><br /></p>',NULL,'lampa-wiszaca-z-abazurem-w-kolorowe-wzory-nowoczesna-dziecieca',NULL,NULL,NULL,'Lampa Wisząca z Abażurem w Kolorowe Wzory Nowoczesna Dziecięca',NULL,NULL,NULL,NULL),
('382','1','1','<p>Wprowadź do swoich wnętrz oświetlenie, które zachwyca oryginalnym stylem i dodaje przytulności pomieszczeniom. Właśnie takim oświetleniem jest nasza <strong><a href=\"/73-lampy-podlogowe-stojace\">lampa stojąca</a> z abażurem w kolorowe wzory</strong>. Prosta, metalowa konstrukcja i barwny abażur tworzą połączenie, które znakomicie ożywia i uatrakcyjnia wnętrza.<br /><br /></p>',NULL,'nowoczesna-lampa-stojaca-dziecieca-abazur-we-wzory',NULL,NULL,NULL,'Nowoczesna Lampa Stojąca Dziecięca Abażur we Wzory',NULL,NULL,NULL,NULL),
('383','1','1','<p>Nowoczesne i oryginalne wnętrza o przytulnym klimacie – kto z nas nie marzy o takim wystroju mieszkania? Z nami łatwo stworzysz zjawiskową aranżację wnętrz. Prezentowana <a href=\"/73-lampy-podlogowe-stojace\">lampa stojąca</a> doda nowoczesności i wyjątkowości wnętrzom, dzięki abażurowi w kolorowe wzory. Ponadto nic tak nie dodaje mieszkaniu więcej przytulności niż barwny, materiałowy abażur lampy.<br /><br /></p>',NULL,'lampa-stojaca-podlogowa-z-abazurem-w-kolorowe-wzory',NULL,NULL,NULL,'Lampa Stojąca Podłogowa z Abażurem w Kolorowe Wzory',NULL,NULL,NULL,NULL),
