('386','1','1','<p>Lampa 3-płomienna z abażurami nadaje wnętrzom wyjątkowości, mimo pozornego prostego wyglądu. <strong>Abażury oświetlenia posiadają złote środki.</strong> Wygląda to oryginalnie, nowocześnie i zarazem elegancko. Złote abażury w kształcie diamentu dodają wyjątkowego charakteru wnętrzom.<br /><br /></p>','DIAMOND GOLD 2145/3','czarna-lampa-wiszaca-z-abazurami-diament-zloty-srodek',NULL,NULL,NULL,'Czarna Lampa Wisząca z Abażurami Diament Złoty Środek',NULL,NULL,NULL,NULL),
('387','1','1','<p>Odmień swoje wnętrza i wprowadź do nich nowoczesność i elegancję. <a href=\"/53-lampy-sufitowe\">Lampa sufitowa</a><strong> z abażurami</strong> znakomicie wygląda w pomieszczeniach urządzonych w stylu nowoczesnym, minimalistycznym, klasycznym czy industrialnym. Złote wnętrza abażurów dodadzą oryginalności i wyjątkowego charakteru Twojemu mieszkaniu.<br /><br /></p>','DIAMOND GOLD 2145/3/OP','czarna-lampa-sufitowa-zyrandol-z-abazurami-diament-zlote-wnetrze',NULL,NULL,NULL,'Czarna Lampa Sufitowa Żyrandol z Abażurami Diament Złote Wnętrze',NULL,NULL,NULL,NULL),
('388','1','1','<p>Dodaj wytwornym wnętrzom nowoczesności, a minimalistycznym aranżacjom odrobinę elegancji. <a href=\"/25-lampy-wiszace-z-abazurami\">Lampa wisząca z abażurami</a> pasuje do wielu stylów wnętrzarskich. Dodaje oryginalności pomieszczeniom w stylu loft, klasycznym lub nowoczesnym. Możesz mieć pewność, że <a href=\"/21-lampy-wiszace\">lampa wisząca</a> cudownie odmieni także Twoje wnętrza.<br /><br /></p>','DIAMOND GOLD 2145/3/OW','nowoczesna-lampa-wiszaca-czarna-ze-zlotymi-abazurami-diament',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Czarna ze Złotymi Abażurami Diament',NULL,NULL,NULL,NULL),
('389','1','1','<p>Niezwykle designerska propozycja oświetlenia, która doda oryginalności wnętrzom urządzonym w stylu nowoczesnym, minimalistycznym i industrialnym. Jeśli lubisz nieszablonowe rozwiązania albo chcesz ożywić stonowany wystrój mieszkania, to nasza <a href=\"/21-lampy-wiszace\">lampa wisząca</a> jest stworzona dla Ciebie!<br /><br /></p>',NULL,'stylowa-lampa-wiszaca-loft-metalowa-oryginalna',NULL,NULL,NULL,'Stylowa Lampa Wisząca Loft Metalowa Oryginalna',NULL,NULL,NULL,NULL),
('390','1','1','<p>Urządzasz wnętrza w stylu loft? Szukasz minimalistycznej, ale oryginalnej lampy do swoich nowoczesnych wnętrz? A może chcesz odmienić stonowany wystrój mieszkania? W każdym z tych przypadków sprawdzi się<strong> stylowa lampa wisząca z metalowym kloszem.</strong> <br /><br /></p>',NULL,'lampa-wiszaca-loft-metalowa-drut-nowoczesna',NULL,NULL,NULL,'Lampa Wisząca Loft Metalowa Drut Nowoczesna',NULL,NULL,NULL,NULL),
('391','1','1','<p>Szukasz oświetlenia, które w subtelny sposób podkreśli wyjątkowy charakter Twoich wnętrz? Nasza <a href=\"/21-lampy-wiszace\">lampa wisząca</a> w stylu loft wygląda oryginalnie, minimalistycznie i nadaje aranżacjom wyjątkowego klimatu.<br /><br /></p>',NULL,'industrialna-lampa-wiszaca-metalowa-led',NULL,NULL,NULL,'Industrialna Lampa Wisząca Metalowa LED',NULL,NULL,NULL,NULL),
('392','1','1','<p>Jak za pomocą jednej lampy odmienić wystrój wnętrza? To proste - wybierz model, który łączy minimalizm i oryginalność. Dzięki temu stworzysz w swoim mieszkaniu magiczny, wyjątkowy nastrój.<br /><br /></p>',NULL,'lampa-wiszaca-loft-metalowa-regulowana-led',NULL,NULL,NULL,'Lampa Wisząca Loft Metalowa Regulowana LED',NULL,NULL,NULL,NULL),
('393','1','1','<p>Trwa moda na wnętrza w stylu loft. Nic dziwnego – styl industrialny wygląda bardzo oryginalnie i czyni mieszkanie niepowtarzalnym. Oświetleniem, które idealnie wyraża charakter loft designu, jest nasza <strong>pojedyncza <a href=\"/21-lampy-wiszace\">lampa wisząca</a> z metalowym kloszem</strong>. Wygląda minimalistycznie, a jednocześnie oryginalnie.<br /><br /></p>',NULL,'lampa-wiszaca-loft-regulowana-zloto-miedz',NULL,NULL,NULL,'Lampa Wisząca Loft Regulowana Złoto Miedź',NULL,NULL,NULL,NULL),
('394','1','1','<p>Szukasz funkcjonalnej, a jednocześnie pięknie wyglądającej <a href=\"/53-lampy-sufitowe\">lampy sufitowej</a>? Mamy dla Ciebie idealne oświetlenie! Nasz <strong>żyrandol sufitowy 2-płomienny</strong> idealnie sprawdza się w roli oświetlenia głównego we wnętrzu. Lampa jest również stylowym elementem wystroju pomieszczenia. Poznaj jej wszystkie zalety i funkcje.<br /><br /></p>',NULL,'lampa-sufitowa-loft-metalowa-regulowana-led',NULL,NULL,NULL,'Lampa Sufitowa Loft Metalowa Regulowana LED',NULL,NULL,NULL,NULL),
('395','1','1','<p>Oświetl swoje wnętrza pięknym żyrandolem sufitowym w stylu loft. Lampa świetnie wygląda w nowoczesnych, skandynawskich, minimalistycznych i oczywiście industrialnych aranżacjach. <strong>Żyrandol jest 3-płomienny</strong>, dzięki czemu sprawdza się w roli oświetlenia głównego w pomieszczeniu.<br /><br /></p>',NULL,'lampa-sufitowa-zyrandol-loft-metal',NULL,NULL,NULL,'Lampa Sufitowa Żyrandol Loft Metal',NULL,NULL,NULL,NULL),
('396','1','1','<p>Poczuj magię stylu loft z piękną lampą sufitową LED. Żyrandol funkcjonalnie oświetla i dekoruje wnętrza. Prosta konstrukcja i niezwykły kształt kloszy tworzą zestawienie, które uczyni Twoje mieszkanie designerskim i oryginalnym.<br /><br /></p>',NULL,'lampa-sufitowa-w-stylu-loft-zyrandol-metalowy-led',NULL,NULL,NULL,'Lampa Sufitowa w Stylu Loft Żyrandol Metalowy LED',NULL,NULL,NULL,NULL),
('397','1','1','<p>Surowy, lecz przyciągający spojrzenia design kinkietu jest wspaniałą dekoracją nie tylko wnętrz w stylu loft. Lampa ścienna komponuje się również ze stylem nowoczesnym, klasycznym, minimalistycznym i retro.<br /><br /></p>','LUMEN 1556/1','kinkiet-lampa-scienna-loft-zlote-elementy',NULL,NULL,NULL,'Kinkiet Lampa Ścienna Loft Złote Elementy',NULL,NULL,NULL,NULL),
('398','1','1','<p>Designerska <a href=\"/53-lampy-sufitowe\">lampa sufitowa</a>, która sprawdzi się nie tylko w typowo industrialnych aranżacjach wnętrz. Oryginalny kształt konstrukcji i złote oprawy wspaniale oddają klimat również pomieszczeń w stylu klasycznym i retro. Żyrandol przyciąga spojrzenia i podkreśla indywidualny charakter wnętrz.<br /><br /></p>','LUMEN 1556/4','lampa-sufitowa-loft-zyrandol-zlote-elementy',NULL,NULL,NULL,'Lampa Sufitowa Loft Żyrandol Złote Elementy',NULL,NULL,NULL,NULL),
('399','1','1','<p><strong>Metalowa Lampa wisząca wiele kolorów <br /></strong><br />Prosta, ale elegancka lampa wprowadzi mnóstwo nowoczesności i wyjątkowego klimatu do Twoich wnętrz. Do wyboru aż sześć niesamowitych kolorów, dzięki czemu z łatwością dobierzesz lampę idealnie pasującą do Twojego stylu.<br /><br /><strong>Gdzie najlepiej prezentuje się lampa wisząca?<br /></strong><br />Dzięki klasycznemu stylowi lampy pasuje ona do wielu pomieszczeń. Może pełnić funkcje oświetlenia kuchennego, pokojowego, biurowego czy salonowego. Żywe kolory, takie jak fuksja, turkus czy żółty świetnie współgrają ze stonowanymi barwami i wspaniale ożywiają pomieszczenie. Natomiast lampa w stonowanych kolorach fantastycznie skontrastuje wnętrze o jasnych, intensywnych barwach.<br /><br /><strong>Z jakich materiałów została stworzona nowoczesna lampa?<br /></strong><br />Oświetlenie sufitowe zostało w całości wykonane z metalu, dzięki czemu masz pewność, że lampa będzie pełnić swoją funkcję przez bardzo długi czas. Dodatkowo lampa posiada możliwość regulacji wysokości, przez co idealnie dopasujesz ją do każdego rozmiaru pomieszczenia. Żyrandol posiada wiele opcji zasilania, w tym oświetlenie LED.</p>','MISA 3021/1','lampa-wiszaca-sufitowa-zyrandol-nowoczesna-led',NULL,NULL,NULL,'Lampa Wisząca Sufitowa Żyrandol Nowoczesna LED',NULL,NULL,NULL,NULL),
('400','1','1','<p>Szukasz <a href=\"/21-lampy-wiszace\">lampy wiszącej</a>, która stanie się dekoracją Twoich wnętrz? Mamy dla Ciebie oświetlenie idealne, które dodatkowo jest niezwykle funkcjonalne. Za oryginalny wygląd <a href=\"/22-lampy-wiszace-nowoczesne\">lampy wiszącej nowoczesnej</a> odpowiada abażur z prześwitującą żarówką. Oświetlenie dostępne jest w wielu kolorach, dzięki czemu otrzymasz dokładnie taki efekt wizualny, jakiego oczekujesz.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-z-abazurem-dziecieca',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza z Abażurem Dziecięca',NULL,NULL,NULL,NULL);
INSERT INTO `ps_product_lang` VALUES
('401','1','1','<p>Stylowa <a href=\"/21-lampy-wiszace\">lampa wisząca</a> o ciekawym i oryginalnym wyglądzie doda Twoim wnętrzom oryginalności. Oświetlenie składa się z metalowej konstrukcji, na której podwieszone są dwa materiałowe abażury częściowo prześwitujące. Dostępna w wielu kolorach do wyboru.<br /><br /></p>',NULL,'lampa-wiszaca-z-abazurami-kolorowa-nowoczesna',NULL,NULL,NULL,'Lampa Wisząca z Abażurami Kolorowa Nowoczesna',NULL,NULL,NULL,NULL),
('402','1','1','<p><a href=\"/22-lampy-wiszace-nowoczesne\">Lampa wisząca nowoczesna</a> wyróżnia się minimalistycznym designem połączonym z niebanalną formą. Abażury dostępne są w szerokiej palecie kolorystycznej - od stonowanych kolorów w odcieniach bieli, jasnej szarości i ciemnoszarego do bardziej intensywnych kolorów: niebieskiego, zielonego, żółtego, różowego czy wrzosowego. Oświetlenie jest ciekawym połączeniem metalowej konstrukcji i materiałowego abażura.<br /><br /></p>',NULL,'lampa-wiszaca-z-abazurami-nowoczesna-dziecieca',NULL,NULL,NULL,'Lampa Wisząca z Abażurami Nowoczesna Dziecięca',NULL,NULL,NULL,NULL),
('403','1','1','<p>Jeżeli szukasz <a href=\"/21-lampy-wiszace\">lampy wiszącej</a>, która będzie pasować do Twojego wnętrza, mamy coś dla Ciebie! Regulowane oświetlenie z wyjątkowymi abażurami doda przytulności i indywidualnego charakteru Twojemu mieszkaniu.<br /><br /></p>',NULL,'lampa-wiszaca-z-kolorowymi-abazurami-led',NULL,NULL,NULL,'Lampa Wisząca z Kolorowymi Abażurami LED',NULL,NULL,NULL,NULL),
('404','1','1','<p>Jak dodać swoim wnętrzom oryginalności i wyjątkowego klimatu? Wprowadź do aranżacji<strong> nowoczesną lampę wiszącą industrialną</strong>. Prezentowane oświetlenie wyróżnia niezwykły design klosza, który jednocześnie zachowuje minimalizm i przyciąga spojrzenia gości.<br /><br /></p>',NULL,'lampa-wiszaca-nowoczesna-loft-metalowa-zlota',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Loft Metalowa Złota',NULL,NULL,NULL,NULL),
('405','1','1','<p>Nowoczesna i minimalistyczna <a href=\"/21-lampy-wiszace\">lampa wisząca</a> z regulowaną długością cudownie odmieni Twoje wnętrze. Duży, metalowy klosz odpowiada za nowoczesny wygląd. Swój oryginalny wygląd lampa wisząca zawdzięcza połączeniu klasyki z nowoczesnością.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-regulowana-metalowa',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Regulowana Metalowa',NULL,NULL,NULL,NULL),
('406','1','1','<p>Szukasz wyjątkowej lampy podłogowej, która będzie jednocześnie funkcjonalna i oryginalna? Mamy propozycję idealną dla Ciebie! Nasza <a href=\"/73-lampy-podlogowe-stojace\">lampa stojąca</a> dostępna jest w wielu kolorach do wyboru, dzięki czemu łatwo dopasujesz ją do wystroju swojego mieszkania.<br /><br /></p>',NULL,'lampa-stojaca-z-abazurem-kolorowa-nowoczesna-led',NULL,NULL,NULL,'Lampa Stojąca z Abażurem Kolorowa Nowoczesna LED',NULL,NULL,NULL,NULL),
('407','1','1','<p>Solidna konstrukcja <a href=\"/61-zwisy-wiszace\">zwisu wiszącego</a> wykonana została z twardego metalu i wzbogacona materiałowym abażurem. Dzięki szerokiej gamie kolorów abażura (do wyboru biały, różowy, jasnoszary, ciemnoszary, czarny, żółty, wrzosowy, zielony, granatowy, błękitny), jak i konstrukcji (w palecie czarny, szary, różowy) istnieje możliwość stworzenia kompozycji lampy według własnego pomysłu, fantazji i potrzeb.<br /><br /></p>',NULL,'lampa-wiszaca-do-pokoju-dziecka-kolorowa-regulowana',NULL,NULL,NULL,'Lampa Wisząca do Pokoju Dziecka Kolorowa Regulowana',NULL,NULL,NULL,NULL),
('408','1','1','<p>Niezwykła <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która dodaje wnętrzom niezwykłego charakteru. Pasuje zarówno do nowoczesnych jak i klasycznych wystrojów wnętrz. Za oryginalny wygląd lampy odpowiadają mocowanie typu “Pająk” i złote wnętrze abażura i diamentowy kształt.<br /><br /></p>','SPIDER 1921/1/DZ','nowoczesna-lampa-wiszaca-zloty-abazur-diament',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Złoty Abażur Diament',NULL,NULL,NULL,NULL),
('409','1','1','<p>Nietypowy sposób wieszania lampy, tj. dwa dodatkowe haczyki podwieszane przy suficie sprawia, że tego oświetlenia po prostu nie da się nie zauważyć! Minimalistyczne kolory połączone z oryginalnym designem tworzą niezwykłe wrażenia estetyczne. Neutralna czerń idealnie równoważy się z żywiołowym złotem. Abażury nadają <a href=\"/21-lampy-wiszace\">lampie wiszącej</a> niezwykłego szyku. Mocna, metalowa konstrukcja jest genialnym przeciwieństwem materiałowych abażurów. Nasza lampa to recepta na idealne oświetlenie w nowoczesnym stylu!<br /><br /></p>','SPIDER 1921/2/DZ','lampa-wiszaca-pajak-ze-zlotymi-abazurami-diament',NULL,NULL,NULL,'Lampa Wisząca Pająk ze Złotymi Abażurami Diament',NULL,NULL,NULL,NULL),
('410','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a>, która doda Twoim wnętrzom wyjątkowego charakteru. Niezwykła konstrukcja w połączeniu z czarnymi abażurami o złotym środku daje niesamowity efekt w pomieszczeniu. <br /><br /></p>','SPIDER 1921/3/DZ','lampa-wiszaca-z-abazurami-diament-zlote-wnetrza',NULL,NULL,NULL,'Lampa Wisząca z Abażurami Diament Złote Wnętrza',NULL,NULL,NULL,NULL),
('411','1','1','<p>Niezwykle nowoczesna i elegancka <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która pasuje się do wielu stylów wnętrzarskich. Niezwykła konstrukcja i abażury ze złotym wnętrzem w kształcie diamentu nadają oryginalności pomieszczeniom.<br /><br /></p>','SPIDER 1921/4/DZ','lampa-wiszaca-zyrandol-z-abazurami-diament-zloto',NULL,NULL,NULL,'Lampa Wisząca Żyrandol z Abażurami Diament Złoto',NULL,NULL,NULL,NULL),
('412','1','1','<p>Nasza <a href=\"/22-lampy-wiszace-nowoczesne\">lampa wisząca nowoczesna</a> stworzy niepowtarzalną atmosferę w każdym domu. Pięć geometrycznych, materiałowych abażurów z zewnątrz obleczone są tajemniczą czernią. Wewnątrz błyszczą eleganckim złotem, emitując dopasowane, dyskretne światło.<br /><br /></p>','SPIDER 1921/5/DZ','stylowa-lampa-wiszaca-zyrandol-led-ze-zlotymi-abazurami-diament',NULL,NULL,NULL,'Stylowa Lampa Wisząca Żyrandol LED ze Złotymi Abażurami Diament',NULL,NULL,NULL,NULL),
('413','1','1','<p>Nasza <a href=\"/21-lampy-wiszace\">lampa wisząca</a> dzięki szerokiemu wachlarzowi wariantów barw idealnie uzupełni wizerunek najbardziej wymagającego pomieszczenia. Oświetlenie pasuje do nowoczesnych wystrojów. Żywe kolory świetnie rozświetlają wnętrza.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-z-kolorowym-abazurem-do-pokoju-dziecka',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza z Kolorowym Abażurem do Pokoju Dziecka',NULL,NULL,NULL,NULL),
('414','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> typu pająk to nietuzinkowy pomysł na nowoczesną dekorację wnętrz. Minimalistyczny design oświetlenia sprawia, że będzie pasować do niemal każdego pomieszczenia. <br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-z-abazurami-dziecieca-kolorowa',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca z Abażurami Dziecięca Kolorowa',NULL,NULL,NULL,NULL),
('415','1','1','<p>Szukasz nowoczesnej <a href=\"/21-lampy-wiszace\">lampy wiszącej</a>, która będzie pasować do Twoich wnętrz? Mamy dla Ciebie oświetlenie, którą można polecić każdemu, kto lubi możliwość dostosowywania produktu do własnych wymagań. Nasza <a href=\"/22-lampy-wiszace-nowoczesne\">lampa wisząca nowoczesna</a> posiada wiele wariantów kolorystycznych oraz możliwość regulacji, które pozwolą Ci stworzyć oświetlenie idealnie pasujące do Twojej aranżacji wnętrz. <br /><br /></p>',NULL,'lampa-wiszaca-z-abazurami-pajak-dziecieca-led',NULL,NULL,NULL,'Lampa Wisząca z Abażurami Pająk Dziecięca LED',NULL,NULL,NULL,NULL),
('416','1','1','<p>Niezwykły <a href=\"/28-zyrandole-z-abazurami\">żyrandol z abażurami</a>, który doda oryginalności każdemu wnętrzu. Konstrukcja typu “pająk” i kolorowe klosze tworzą niesamowitą <a href=\"/21-lampy-wiszace\">lampę wiszącą</a> oddającą klimat wielu rodzajów wnętrz.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-kolorowa-z-abazurami-pajak',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Kolorowa z Abażurami Pająk',NULL,NULL,NULL,NULL),
('417','1','1','<p>Niezwykła <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która doda wyjątkowości Twoim wnętrzom. Ogromny wybór kolorów abażurów daje wiele możliwości na stworzenie oświetlenia idealnie dopasowanego do wystroju mieszkania.<br /><br /></p>',NULL,'lampa-wiszaca-zyrandol-z-abazurami-led',NULL,NULL,NULL,'Lampa Wisząca Żyrandol z Abażurami LED',NULL,NULL,NULL,NULL),
('418','1','1','<p>Stylowa <a href=\"/25-lampy-wiszace-z-abazurami\">lampa wisząca z abażurem</a> zaprojektowana w nowoczesnym stylu. Wytrzymała, metalowa konstrukcja pozwala na łatwy montaż na suficie. Materiałowy abażur z ozdobnym, prześwitującym motywem, dostępny jest w kolorach: białym, różowym, jasnoszarym, ciemnoszarym, żółtym, wrzosowym, zielonym i niebieskim.<br /><br /></p>',NULL,'lampa-wiszaca-pajak-z-kolorowym-abazurem-nowoczesna-dziecieca',NULL,NULL,NULL,'Lampa Wisząca Pająk z Kolorowym Abażurem Nowoczesna Dziecięca',NULL,NULL,NULL,NULL),
('419','1','1','<p>Prezentowana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> opiera się na wyjątkowej i oryginalnej konstrukcji typu pająk. Dwa wiszące abażury stanowią mocne akcenty jej projektu. Przedzielone są w połowie bezbarwną tkaniną, zaakcentowaną srebrzystym paskiem. Element dodaje lampie wyjątkowości oraz gwarantuje stonowaną emisję światła.<br /><br /></p>',NULL,'lampa-wiszaca-nowoczesna-z-kolorowymi-abazurami',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna z Kolorowymi Abażurami',NULL,NULL,NULL,NULL),
('420','1','1','<p>Prezentowana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> ma wyjątkową i bardzo nowoczesną konstrukcję typu pająk. Częściowo prześwitująca przez abażur żarówka nadaje lampie oryginalności i zwiększa obszar oświetlenia w pomieszczeniu.<br /><br /></p>',NULL,'lampa-wiszaca-pajak-kolorowe-abazury',NULL,NULL,NULL,'Lampa Wisząca Pająk Kolorowe Abażury',NULL,NULL,NULL,NULL),
('421','1','1','<p>Prezentowana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> jest doskonałym wykończeniem każdego wnętrza. Wykonana z solidnych materiałów zapewnia trwałość na lata. Niecodzienny kształt typu pająk zapewnia równomierną dystrybucję światła w pomieszczeniu.<br /><br /></p>',NULL,'lampa-wiszaca-nowoczesna-pajak-z-abazurami',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Pająk z Abażurami',NULL,NULL,NULL,NULL),
('422','1','1','<p><a href=\"/22-lampy-wiszace-nowoczesne\">Lampa wisząca nowoczesna</a> wykonana w formie wyjątkowej konstrukcji typu pająk to doskonała propozycja dla miłośników uniwersalnych i niebanalnych elementów wyposażenia wnętrz. Funkcjonalny i bardzo estetyczny żyrandol świetnie sprawdzi się w różnych stylach i pomieszczeniach. <br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-zyrandol-pajak-z-abazurami',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Żyrandol Pająk z Abażurami',NULL,NULL,NULL,NULL),
('423','1','1','<p>Urocza <a href=\"/74-lampy-dzieciece\">lampa dziecięca</a>, która pasuje zarówno do pokoju chłopca jak i dziewczynki. Abażur z motywem wesołych sówek doda radosnego i pogodnego charakteru aranżacji pomieszczenia.<br /><br /></p>',NULL,'lampa-wiszaca-do-pokoju-dziecka-abazur-sowy',NULL,NULL,NULL,'Lampa Wisząca do Pokoju Dziecka Abażur Sowy',NULL,NULL,NULL,NULL),
('424','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> idealna zarówno do pokoju najmłodszych jak i nastolatków. Abażur z kolorową mapą świata jest radosnym akcentem w aranżacji pomieszczenia.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-dziecieca-abazur-mapa',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Dziecięca Abażur Mapa',NULL,NULL,NULL,NULL),
('425','1','1','<p>Chcesz, aby pokój Twojej małej córeczki był wyjątkowy i pełen radosnego nastroju? Dodaj do niego <a href=\"/34-lampy-z-abazurami\">lampę z abażurem</a> z jednorożcem. Wesoły motyw z pewnością spodoba się dziecku oraz wkomponuje się w całą aranżację pokoju.<br /><br /></p>',NULL,'lampa-wiszaca-dziecieca-abazur-jednorozec',NULL,NULL,NULL,'Lampa Wisząca Dziecięca Abażur Jednorożec',NULL,NULL,NULL,NULL),
('426','1','1','<p>Urocza <a href=\"/25-lampy-wiszace-z-abazurami\">lampa wisząca z abażurem</a> w sowy spodoba się tym najmłodszym jak i nieco starszym dzieciom. Odcienie różu, fioletu i błękitu cudownie rozweselą pokój Twojej córeczki.<br /><br /></p>',NULL,'lampa-wiszaca-dziecieca-z-abazurem-w-rozowe-sowy',NULL,NULL,NULL,'Lampa Wisząca Dziecięca z Abażurem w Różowe Sowy',NULL,NULL,NULL,NULL),
('427','1','1','<p>Wyjątkowa <a href=\"/25-lampy-wiszace-z-abazurami\">lampa wisząca z abażurem</a>, która pasuje do nowoczesnych wystrojów wnętrz. Oddaje również klimat skandynawskich i minimalistycznych aranżacji. Wzór abażura w zygzaki o odcieniach fioletu doda oryginalności Twoim wnętrzom.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-abazur-w-kolorowe-zygzaki',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca Abażur w Kolorowe Zygzaki',NULL,NULL,NULL,NULL),
('428','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a>, która doskonale oddaje klimat wnętrz w stylu skandynawskim, nowoczesnym i minimalistycznym. Niezwykły wzór abażura w połączeniu z prostą konstrukcją tworzą lampę, która zachwyca wyjątkową formą.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-z-abazurem-we-wzory',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza z Abażurem we Wzory',NULL,NULL,NULL,NULL),
('429','1','1','<p>Niezwykła <a href=\"/21-lampy-wiszace\">lampa wisząca</a>, która świetnie komponuje się z wnętrzami w stylu nowoczesnym, skandynawskim i minimalistycznym. Prosta konstrukcja i oryginalny wzór abażura dodadzą Twojemu wnętrzu wyjątkowego nastroju.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-z-abazurem-w-zygzaki',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca z Abażurem w Zygzaki',NULL,NULL,NULL,NULL),
('430','1','1','<p>Szukasz oryginalnej lampy kuchennej? Mamy dla Ciebie świetną propozycję! <a href=\"/25-lampy-wiszace-z-abazurami\">Lampa wisząca z abażurem</a> PCV będzie stylową dekoracją i funkcjonalnym oświetleniem Twojej kuchni.<br /><br /></p>',NULL,'lampa-wiszaca-do-kuchni-abazur-coffe',NULL,NULL,NULL,'Lampa Wisząca do Kuchni Abażur Coffe',NULL,NULL,NULL,NULL),
('431','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> ze względu na swoją formę, potrafi wpasować się do wielu funkcjonalnych bądź stylizowanych aranżacji. <strong>Oświetlenie o kryształowym kloszu</strong> i klasycznej, eleganckiej formie to połączenie funkcjonalności i stylu.<br /><br /></p>','HOLDI 2200/1','lampa-wiszaca-ze-szklanym-zyrandolem',NULL,NULL,NULL,'Lampa Wisząca ze szklanym Żyrandolem',NULL,NULL,NULL,NULL),
('432','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> w nowoczesnym stylu doda uroku każdemu wnętrzu. Prostokątna konstrukcja z dwoma linkami doskonale rozprowadza światło po pomieszczeniu. Prosta, ale solidna, wykonana z trwałych materiałów gwarantuje doskonałą jakość i wydajność.<br /><br /></p>','HOLDI 2200/2','lampa-wiszaca-z-krysztalowym-zyrandolem',NULL,NULL,NULL,'Lampa Wisząca z Kryształowym Żyrandolem',NULL,NULL,NULL,NULL),
('433','1','1','<p>Prezentowana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> doda Twojemu wnętrzu elegancji. Prosta konstrukcja połączona z oryginalnymi, kryształowymi kloszami dają ponadczasowe oświetlenie, które stanie się największą dekorację pomieszczenia.<br /><br /></p>','HOLDI 2200/3','nowoczesna-lampa-wiszaca-ze-szklanymi-kloszami',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca ze szklanymi Kloszami',NULL,NULL,NULL,NULL),
('434','1','1','<p><a href=\"/24-lampy-wiszace-ze-szklanymi-kloszami\">Lampa wisząca ze szklanymi kloszami</a> spełnia nie tylko funkcję praktyczną, ale także dekoracyjną. Jej prostota i minimalizm idealnie nadają się do wykończenia wnętrz urządzonych w stylu współczesnym. Surowe materiały, z których zostało wykonane oświetlenie, pasuje również do pomieszczeń w stylu loft.<br /><br /></p>','HOLDI 2200/3/OW','nowoczesna-lampa-wiszaca-ze-szklanym-kloszem',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca ze Szklanym Kloszem',NULL,NULL,NULL,NULL),
('435','1','1','<p>Pojedyncza <a href=\"/21-lampy-wiszace\">lampa wisząca</a> to propozycja dla wszystkich tych, którzy poszukują rozwiązań do nowoczesnych, industrialnych pomieszczeń. To, co czyni oświetlenie wyjątkowym, to przede wszystkim równa linia, styl i prostota. Są to cechy bardzo ważne dla surowego stylu industrialnego.<br /><br /></p>',NULL,'lampa-wiszaca-w-stylu-loft-z-metalu',NULL,NULL,NULL,'Lampa Wisząca w Stylu Loft z Metalu',NULL,NULL,NULL,NULL),
('436','1','1','<p>Prezentowana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> została wykonana w stylu industrialnym. Jej oryginalny design sprawia, że pasować będzie do wielu różnych rodzajów wnętrz. Złoty klosz odsłaniajacy żarówkę dodaje lampie wyjątkowości i elegancji.<br /><br /></p>',NULL,'lampa-wiszaca-loft-metalowa-ze-zlotym-kloszem',NULL,NULL,NULL,'Lampa Wisząca Loft Metalowa ze Złotym Kloszem',NULL,NULL,NULL,NULL),
('437','1','1','<p><a href=\"/55-lampy-sufitowe-nowoczesne\">Nowoczesna lampa sufitow</a>a jest idealnym oświetleniem dla zwolenników prostych, ale zarazem efektownych rozwiązań. <a href=\"/79-plafony-domowe-wewnetrzne\">Plafon domowy</a> pasuje zarówno do nowoczesnych jak i industrialnych wystrojów wnętrz.<br /><br /></p>',NULL,'lampa-sufitowa-plafon-w-stylu-loft-z-metalu',NULL,NULL,NULL,'Lampa Sufitowa Plafon w Stylu Loft z Metalu',NULL,NULL,NULL,NULL),
('438','1','1','<p>Przedstawiamy <a href=\"/53-lampy-sufitowe\">lampę sufitową</a>, która promienieje energią i jest w stałym związku z estetyką. <a href=\"/79-plafony-domowe-wewnetrzne\">Plafon</a> ma nowatorski kształt i z pewnością spodoba się wielbicielom niestandardowych kształtów.<br /><br /></p>',NULL,'nowoczesna-lampa-sufitowa-plafon-loft-ze-zlotym-kloszem',NULL,NULL,NULL,'Nowoczesna Lampa Sufitowa Plafon Loft ze Złotym Kloszem',NULL,NULL,NULL,NULL),
('439','1','1','<p>Nowoczesne wnętrza wymagają niezwykłych dodatków. Nasza <a href=\"/53-lampy-sufitowe\">lampa sufitowa</a> właśnie do nich należy. Wyróżnia się spośród wielu innych modeli. Estetyka plafonu wywodzi się ze stylu industrialnego.<br /><br /></p>',NULL,'lampa-sufitowa-plafon-metalowy-loft-led',NULL,NULL,NULL,'Lampa Sufitowa Plafon Metalowy Loft LED',NULL,NULL,NULL,NULL),
('440','1','1','<p>Prezentowany model to nowoczesny projekt oświetlenia w stylu typowo industrialnym, skromnym, bez zbędnych ozdób oraz dekoracji. Efektowne reflektorki wyglądają wyjątkowo i dodają urody nowoczesnym wnętrzom.<br /><br /></p>',NULL,'nowoczesna-lampa-sufitowa-loft-plafon-zyrandol',NULL,NULL,NULL,'Nowoczesna Lampa Sufitowa Loft Plafon Żyrandol',NULL,NULL,NULL,NULL),
('441','1','1','<p>Lampa taka jak ta zbuduje w Twoich czterech kątach komfortową, sprzyjającą relaksowi atmosferę.  Oświetlenie sprawi, że poczujesz się wyjątkowo i bezpiecznie. <a href=\"/79-plafony-domowe-wewnetrzne\">Plafon</a> reprezentuje loftowy design wzbogacony o współczesne rozwiązania funkcjonalne. Lampa ta jest zatem niebywale praktyczna jak i estetyczna.<br /><br /></p>',NULL,'lampa-sufitowa-loft-ze-zlotymi-kloszami',NULL,NULL,NULL,'Lampa Sufitowa Loft ze Złotymi Kloszami',NULL,NULL,NULL,NULL),
('442','1','1','<p>Nowoczesna i elegancka <a href=\"/21-lampy-wiszace\">lampa wisząca</a> to połączenie stylu klasycznego z nowoczesnym wzornictwem. Oświetlenie prezentuje się niebywale uniwersalnie i ponadczasowo.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-ze-szklanymi-kloszami-led',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca ze Szklanymi Kloszami LED',NULL,NULL,NULL,NULL),
('443','1','1','<p>Szklane <a href=\"/21-lampy-wiszace\">lampy wiszące</a> nie od dziś są kojarzone z elegancją i modernizmem. <a href=\"/62-zwisy-wiszace-pojedyncze-nowoczesne\">Zwisy wiszące pojedyncze nowoczesne</a> stanowią wyjątkowy element wystroju. Dzięki kilku kolorom do wyboru bez problemu dopasują się do różnych aranżacji wnętrz. Niestandardowy, szklany klosz przyciąga uwagę, nadając niepowtarzalny klimat w pomieszczeniu.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-nowoczesna-ze-szklanym-kloszem',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Nowoczesna ze Szklanym Kloszem',NULL,NULL,NULL,NULL),
('444','1','1','<p>Jeśli chciałbyś oświetlić swoje pomieszczenie i szukasz eleganckiej, a równocześnie <a href=\"/22-lampy-wiszace-nowoczesne\">nowoczesnej lampy wiszącej</a>, to dobrze trafiłeś. Oferowana lampa charakteryzuje się ciekawym wyglądem. Szklane klosze są finezyjne i wyjątkowe, więc na pewno zwrócą uwagę przybyłych gości.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-ze-szklanymi-kolorowymi-kloszami',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca ze Szklanymi Kolorowymi Kloszami',NULL,NULL,NULL,NULL),
('445','1','1','<p>Przedstawiamy <a href=\"/21-lampy-wiszace\">lampę wiszącą</a>, która łączy w sobie niecodzienne rozwiązania z unikalnym designem. Model przyciąga wzrok i powoduje, że nikt nie przejdzie obok niego  obojętnie!<br /><br /></p>',NULL,'stylowa-lampa-wiszaca-nowoczesna-szklane-klosze',NULL,NULL,NULL,'Stylowa Lampa Wisząca Nowoczesna Szklane Klosze',NULL,NULL,NULL,NULL),
('446','1','1','<p>Proste rozwiązania są najlepsze. Dlatego planując nowoczesne wnętrze, należy uwzględnić w nim <a href=\"/24-lampy-wiszace-ze-szklanymi-kloszami\">wiszącą lampę ze szklanymi kloszami</a>. Oryginalna kolorystyka i ciekawy styl idealnie dopasują się do stylu industrialnego. Połączenie szkła i czarnej podsufitki doskonale ozdobi każde wnętrze.<br /><br /></p>',NULL,'nowoczesna-lampa-wiszaca-led-ze-szklanymi-kloszami',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca LED ze Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('447','1','1','<p>Prezentowana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> swym wyglądem jak i funkcjonalnością zadowoli wszystkich, nawet najbardziej wymagających klientów. Żyrandol uosabia wszystkie cechy przypisywane stylowi nowoczesnemu. <br /><br /></p>',NULL,'lampa-wiszaca-szklany-zyrandol-led',NULL,NULL,NULL,'Lampa Wisząca Szklany Żyrandol LED',NULL,NULL,NULL,NULL),
('448','1','1','<p>Szyk, elegancja i ponadczasowość - to cechy opisujące prezentowaną <a href=\"/21-lampy-wiszace\">lampę wiszącą</a>. Słoneczna barwa klosza świetnie komponuje się z klasyczną czernią podsufitki dając tym samym kunsztowny design idealnie wpisujący się w obowiązujące obecnie trendy w branży oświetlenia wnętrz.<br /><br /></p>','MADRYT 2225/1/M','designerska-lampa-wiszaca-pojedyncza-ze-szklanym-kloszem',NULL,NULL,NULL,'Designerska Lampa Wisząca Pojedyncza ze Szklanym Kloszem',NULL,NULL,NULL,NULL),
('449','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> idealnie sprawdzi się w roli głównego dystrybutora światła. Umieszczona w centralnym punkcie pomieszczenia w fenomenalny sposób je rozświetli i nada mu ciekawego akcentu. <a href=\"/61-zwisy-wiszace\">Zwis wiszący</a> pasuje przede wszystkim do geometrycznych mebli, tapicerowanych kanap i foteli, a także do subtelnych dodatków. <br /><br /></p>','MADRYT 2225/1','lampa-wiszaca-designerska-ze-szklanym-kloszem-led',NULL,NULL,NULL,'Lampa Wisząca Designerska ze Szklanym Kloszem LED',NULL,NULL,NULL,NULL),
('450','1','1','<p>Druciana <a href=\"/21-lampy-wiszace\">lampa wisząca</a> została stworzona z dbałością o każdy nawet najmniejszy szczegół! <a href=\"/61-zwisy-wiszace\">Zwis wiszący</a> wyróżnia ekstrawagancki design, który świetnie odnajduje się w stylizacji surowego loftu. Prosta forma oświetlenia idealnie pasuje do takich atrybutów industrialnego stylu jak szkło, beton lub cegła.<br /><br /></p>','TORONTO 2245/1','lampa-wiszaca-pojedyncza-loft-z-metalu-led',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Loft z Metalu LED',NULL,NULL,NULL,NULL),
('451','1','1','<p>Elementami wyróżniającymi <a href=\"/21-lampy-wiszace\">lampę wiszącą</a> na tle innych są dwa klosze o drucianej, minimalistycznej formie. Całość prezentuje się tak jak na styl loft przystało - surowo, chłodno i niezwykle stylowo. <br /><br /></p>','TORONTO 2245/2','lampa-wiszaca-nowoczesna-loft-regulowana-z-metalu',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Loft Regulowana z Metalu',NULL,NULL,NULL,NULL),
('452','1','1','<p>Lampa trójpłomienna rewelacyjnie pasuje do każdego typu pomieszczenia. Oświetlenie składa się z okrągłej podsufitki oraz trzech zgrabnych kloszy. <strong>Całość prezentuje się w niezwykle designersko!</strong> <a href=\"/21-lampy-wiszace\">Lampa wisząca</a> stylowo odbiega od utartych schematów i znanych koncepcji.<br /><br /></p>','TORONTO 2245/3/OW','lampa-wiszaca-metalowa-regulowana-loft',NULL,NULL,NULL,'Lampa Wisząca Metalowa Regulowana Loft',NULL,NULL,NULL,NULL),
('453','1','1','<p><a href=\"/21-lampy-wiszace\">Lampa wisząca</a> na belce jest jedną z najczęściej występujących form oświetlenia w kuchni, jadalni i wielu innych wnętrzach. <strong>Lampa posiada aż 3 miejsca na żarówki</strong>, a co za tym idzie, starannie oświetla wybraną przestrzeń. Oświetlenie buduje wyjątkowy nastrój, który udziela się każdemu domownikowi!<br /><br /></p>','TORONTO 2245/3','nowoczesna-lampa-wiszaca-w-stylu-loft-regulowana',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca w Stylu Loft Regulowana',NULL,NULL,NULL,NULL),
('454','1','1','<p><a href=\"/24-lampy-wiszace-ze-szklanymi-kloszami\">Lampy wiszące ze szklanymi kloszami</a> to nie od dzisiaj domena modernizmu i elegancji. Na pokładzie pomieszczeń urządzonych w nowoczesnym stylu i z odrobiną luksusu, z pewnością znajdzie się szkło i metal. Połączenie <a href=\"/84-zrodla-swiatla\">źródła światła</a> ze szklanym kloszem daje spektakularny efekt, o którym przekonasz się we własnym domu wybierając <a href=\"/22-lampy-wiszace-nowoczesne\">lampę wiszącą nowoczesną</a> do swoich wnętrz. <strong>Szklana lampa wisząca sprawdzi się we wszystkich pomieszczeniach,</strong> dozując optymalną dawkę rozświetlenia. <br /><br /></p>','ROMA 2240/1','lampa-wiszaca-pojedyncza-nowoczesna-z-regulacja',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Nowoczesna z Regulacją',NULL,NULL,NULL,NULL),
('455','1','1','<p>W każdym pomieszczeniu, które aranżujemy w nowoczesny sposób, oświetlenie powinno być subtelne i wyróżniać się zaskakującą formą. <a href=\"/21-lampy-wiszace\">Lampa wisząca</a> z podwójnym źródłem światła jest idealną propozycją do nowoczesnych wystrojów wnętrz. Zaskakujący wygląd i efekt świetlny to zasługa łączenia metalowych i szklanych elementów, które razem tworzą spójną całość. <br /><br /></p>','ROMA 2240/2','lampa-wiszaca-nowoczesna-metalowa-szklana',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Metalowa Szklana',NULL,NULL,NULL,NULL),
('456','1','1','<p>Aranżacja nowoczesnych wnętrz jest prosta, jeśli wykorzystujemy odpowiednie elementy. Należy do nich <a href=\"/21-lampy-wiszace\">lampa wisząca</a> z metalowo - szklanymi kloszami, dzięki którym Twoja kuchnia, sypialnia czy salon zamienią się w luksusowy apartament! <a href=\"/22-lampy-wiszace-nowoczesne\">Nowoczesna lampa wisząca</a> na listwie to połączenie dwóch surowców i znakomitego projektu.<br /><br /></p>','ROMA 2240/3','nowoczesna-lampa-wiszaca-z-metalu-szkla',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca z Metalu Szkła',NULL,NULL,NULL,NULL),
('457','1','1','<p><a href=\"/22-lampy-wiszace-nowoczesne\">Nowoczesna lampa wisząca</a> z czarną podsufitką, która jest znakomitym elementem oświetleniowym do wielu pomieszczeń. Koncepcja aranżacji mieszkania z prezentowanym produktem nie sprawi problemów. Do wykonania lampy wykorzystano uniwersalne surowce - przezroczyste szkło i metal w czarnym kolorze. <br /><br /></p>','ROMA 2240/3/OW','lampa-wiszaca-nowoczesna-ze-szklanymi-kloszami-z-metalu',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna ze Szklanymi Kloszami z Metalu',NULL,NULL,NULL,NULL),
('458','1','1','<p>Wyrazisty i ekspresyjny element w aranżacji mieszkania pozwala na zmianę jego charakteru o 180 stopni. Nowoczesne wnętrza potrzebują wyjątkowych dodatków, które zmienią ich oblicze. <strong>Lampa wisząca z sześcioma źródłami światła</strong> to doskonały sposób na ubarwienie wnętrza! Sześć kloszy wykonanych z połączenia przezroczystego szkła i czarnego metalu zadba o wysoki poziom naświetlenia w urządzanym pomieszczeniu.<br /><br /></p>','ROMA 2240/6','lampa-wiszaca-nowoczesna-zyrandol-metal-szklo',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Żyrandol Metal Szkło',NULL,NULL,NULL,NULL),
('459','1','1','<p>Styl industrialny kojarzy się z surowymi wykończeniami, które prezentują się niezwykle stylowo. Czarny kolor i metalowa konstrukcja to połączenie minimalizmu i trwałości, która robi wrażenie. Kształt metalowych kloszy przywodzi na myśl ostro ścięty diament i pozwala na maksymalne wyeksponowanie żarówki.<br /><br /></p>',NULL,'lampa-sufitowa-loft-regulowana-z-metalu',NULL,NULL,NULL,'Lampa Sufitowa Loft Regulowana z Metalu',NULL,NULL,NULL,NULL),
('460','1','1','<p>Aranżację inspirowaną stylem futurystycznym lub nowoczesnym, doskonale uzupełni <a href=\"https://light-home.pl/25-lampy-wiszace-z-abazurami\" title=\"lampa wisząca z abażurem\">lampa wisząca z abażurem</a>. Neonowe barwy, które kontrastują z jasnymi bądź ciemnymi meblami to niemalże definicja stylu nowoczesnego.<strong> <a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"Lampa wisząca\">Lampa wisząca</a></strong> ma nowoczesny wydźwięk, zaakcentowany przez abażur w wyrazistym kolorze.<br /><br /></p>',NULL,'lampa-wiszaca-pojedyncza-kolorowa-pajak-abazur',NULL,NULL,NULL,'Lampa Wisząca Pojedyncza Kolorowa Pająk Abażur',NULL,NULL,NULL,NULL),
('461','1','1','<p>Industrialny wygląd surowo wykończonych kabli i prostych form został zamknięty w pozornie prostej <a href=\"https://light-home.pl/21-lampy-wiszace\">lampie wiszącej</a>. Nie lada zaletą oświetlenia jest mnogość kolorów, które mamy do wyboru.<br /><br /></p>',NULL,'kolorowa-lampa-wiszaca-pajak-z-abazurami',NULL,NULL,NULL,'Kolorowa Lampa Wisząca Pająk z Abażurami',NULL,NULL,NULL,NULL),
('462','1','1','<p><a href=\"https://light-home.pl/21-lampy-wiszace\">Lampa wisząca</a> idealnie uzupełnia każdą nowoczesną aranżację wnętrz nadając jej wyrazistego charakteru. Stylowy, metalowy klosz dodaje szyku i ekspresji każdemu pomieszczeniu. <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\" title=\"nowoczesna lampa wisząca\">Lampa wisząca nowoczesna</a> to dobre wykończenie nie tylko dla stylu loftowego.<br /><br /></p>','SANTOS 2213/1','lampa-wiszaca-loft-ze-zlotym-kloszem-metal',NULL,NULL,NULL,'Lampa Wisząca Loft Ze Złotym Kloszem Metal',NULL,NULL,NULL,NULL),
('463','1','1','<p>Coraz częściej szukając wystroju do nowoczesnych pomieszczeń wybierana jest lampa w stylu loftowym bądź minimalistycznym.Prezetnowane oświetlenie, dzięki metalowemu kloszowi świetnie wyeksponuje ozdobne żarówki, a także rozjaśni każde większe pomieszczenie. Niepowtarzalny design nada wyjątkowego klimatu w Twoim domu.<br /><br /></p>','SANTOS 2214/3','lampa-wiszaca-loft-na-listwie-zlote-klosze',NULL,NULL,NULL,'Lampa Wisząca Loft na Listwie Złote Klosze',NULL,NULL,NULL,NULL),
('464','1','1','<p>Prezentowana <a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"lampa wisząca\">lampa wisząca</a> to połączenie chłodnego loftowego stylu z nowoczesnością. Złoty klosz spełnia nie tylko funkcję praktyczną, lecz stanowi także idealną ozdobę do każdego pomieszczenia. <a href=\"https://light-home.pl/84-zrodla-swiatla\" title=\"źródło światła\">Źródło światła</a> jest subtelne, ale wyróżnia się niepowtarzalną formą.<br /><br /></p>','SANTOS 2214/2','industrialna-lampa-wiszaca-metalowa-ze-zlotymi-kloszami',NULL,NULL,NULL,'Industrialna Lampa Wisząca Metalowa ze Złotymi Kloszami',NULL,NULL,NULL,NULL),
('465','1','1','<p><a href=\"https://light-home.pl/53-lampy-sufitowe\" title=\"lampa sufitowa\">Lampę sufitową</a> w stylu loft wyróżnia oryginalny design, który ozdobi i rozjaśni każde wnętrze. Metalowe klosze w złotym kolorze to połączenie minimalizmu i wyjątkowości.<br /><br /></p>','SANTOS 2213/3/OP','lampa-sufitowa-metalowa-loft-ze-zlotymi-kloszami',NULL,NULL,NULL,'Lampa Sufitowa Metalowa Loft ze Złotymi Kloszami',NULL,NULL,NULL,NULL),
('466','1','1','<p>Postaw na nowoczesne i oryginalne oświetlenie w swoim mieszkaniu. Niepowtarzalna forma naszej <a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"lampa wisząca\">lampy wiszącej</a> zapewnia odpowiednie oświetlenie nawet dużego pomieszczenia oraz wyjątkowy styl.<br /><br /></p>','SANTOS 2213/3/OW','lampa-wiszaca-loft-regulowana-ze-zlotymi-kloszami',NULL,NULL,NULL,'Lampa Wisząca Loft Regulowana ze Złotymi Kloszami',NULL,NULL,NULL,NULL),
('467','1','1','<p>Jeżeli jesteś fanem klasyki połączonej z nutką nowoczesności, to ta <a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"lampa wisząca\">lampa wisząca</a> spełni Twoje oczekiwania. Klasyczne, szklane klosze wykonane w niepowtarzalnym stylu dodadzą Twoim wnętrzom wyjątkowości. 3-płomienna lampa doskonale sprawdzi się jako główny dystrybutor oświetlenia w pomieszczeniu.<br /><br /></p>','HOLDI 2202/3/OW','lampa-wiszaca-szklana-regulowana-led',NULL,NULL,NULL,'Lampa Wisząca Szklana Regulowana LED',NULL,NULL,NULL,NULL),
('468','1','1','<p>Prezentowana <a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"lampa wisząca\">lampa wisząca</a> nada Twojemu wnętrzu szyku i elegancji. Promienie światła przebijające przez złote szkło stworzą przytulną atmosferę idealną na jesienne wieczory. Połączenie szkła i czarnego metalu sprawdzi się doskonale jako dopełnienie nowoczesnych pomieszczeń, wypełniając je odrobiną luksusu.&lt;<br /><br /></p>','HOLDI 2203/3/OW/Z','elegancka-lampa-wiszaca-ze-szklanymi-zlotymi-kloszami',NULL,NULL,NULL,'Elegancka Lampa Wisząca ze Szklanymi Złotymi Kloszami',NULL,NULL,NULL,NULL),
('469','1','1','<p>Aranżacja nowoczesnych wnętrz jest stosunkowo prosta, jeżeli zabierzemy się za to w odpowiedni sposób. <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\" title=\"nowoczesne lampy wiszące\">Lampa wisząca nowoczesna</a> dopełni każde wnętrze dodając mu blasku. Oświetlenie komponuje się zarówno ze stylem nowoczesnym jak i klasycznym.<br /><br /></p>','HOLDI 2203/3/OW','nowoczesna-lampa-wiszaca-ze-szklanymi-kloszami-regulowana',NULL,NULL,NULL,'Nowoczesna Lampa Wisząca ze Szklanymi Kloszami Regulowana',NULL,NULL,NULL,NULL),
('470','1','1','<p>Szyk, elegancja i nowoczesność to słowa, które doskonale opisują prezentowany model oświetlenia. Ponadczasowa, unikalna <a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"lampy wiszące\">lampa wisząca</a> komponuje się z większością wnętrz, nadając im przyjemny klimat. Koncepcja aranżacji wnętrza z<strong> </strong><a href=\"https://light-home.pl/24-lampy-wiszace-ze-szklanymi-kloszami\" title=\"lampy wiszące ze szklanymi kloszami\">lampą wiszącą ze szklanymi kloszami</a> nie będzie stanowiła problemu. Idealnie sprawdzi się ona zarówno w klasycznych jaki i nowoczesnych wnętrzach.<br /><br /></p>','HOLDI 2202/3/OW/Z','lampa-wiszaca-nowoczesna-szklane-zlote-klosze',NULL,NULL,NULL,'Lampa Wisząca Nowoczesna Szklane Złote Klosze',NULL,NULL,NULL,NULL),
('471','1','1','<p>Ta <a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"lampa wisząca\">lampa wisząc</a>a łączy zwolenników klasycznych stylów i efektownych rozwiązań. Nowoczesne oświetlenie z przezroczystymi kloszami wpasowuje się w każdym typ wnętrza, nie zaburzając równowagi, a jedynie nadając szyku.<br /><br /></p>','HOLDI 2203/3','lampa-wiszaca-ze-szklanymi-kloszami-regulowana-led',NULL,NULL,NULL,'Lampa Wisząca ze Szklanymi Kloszami Regulowana LED',NULL,NULL,NULL,NULL),
('472','1','1','<p>Jeśli zastanawiasz się, jak dodać więcej blasku do swojego wnętrza, to już spieszymy z pomocą. Nasza <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\">nowoczesna lampa wisząca</a> sprawdzi się doskonale w każdym pomieszczeniu. Niepowtarzalna konstrukcja i odpowiednie barwy nadadzą wyjątkowego klimatu w Twoim domu.<br /><br /></p>','HOLDI 2203/3/Z','lampa-wiszaca-zlote-szklane-klosze-metal',NULL,NULL,NULL,'Lampa Wisząca Złote Szklane Klosze Metal',NULL,NULL,NULL,NULL),
('473','1','1','<p>Styl nowoczesny jest aktualnie jednym z najbardziej popularnych wystrojów wnętrz. Nasza unikatowa<strong> </strong><a href=\"https://light-home.pl/21-lampy-wiszace\" title=\"lampa wisząca\">lampa wisząca</a> idealnie oddaje charakter nowoczesnych aranżacji. Oświetlenie zapewni dużą ilość światła w całym domu, a elegancki styl doda uroku każdej aranżacji wnętrza.<br /><br /></p>','HOLDI 2202/3','elegancka-lampa-wiszaca-ze-szklanymi-kloszami-led',NULL,NULL,NULL,'Elegancka Lampa Wisząca ze Szklanymi Kloszami LED',NULL,NULL,NULL,NULL),
('474','1','1','<p><a href=\"https://light-home.pl/21-lampy-wiszace\">Lampy wiszące</a> <strong>ze szkła</strong> kojarzą się z nowoczesnością i elegancją. Jeżeli planujesz nieco odmienić wygląd wnętrza, to nie może zabraknąć prezentowanej lampy w Twoim pomieszczeniu. Połączenie czerni i szkła daje spektakularny efekt. <strong>Potrójna lampa wisząca</strong> doskonale sprawdza się w pomieszczeniach potrzebujących większej ilości światła.<br /><br /></p>','HOLDI 2202/3/Z','klasyczna-lampa-wiszaca-ze-zlotymi-szklanymi-kloszami',NULL,NULL,NULL,'Klasyczna Lampa Wisząca ze Złotymi Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('475','1','1','<p>Minimalistyczna <a href=\"https://light-home.pl/55-lampy-sufitowe-nowoczesne\" title=\"lampa sufitowa nowoczesna\">lampa sufitowa nowoczesna</a> doda uroku każdemu wnętrzu. Pojedyncze <a href=\"https://light-home.pl/84-zrodla-swiatla\" title=\"źródło światła\">źródło światła </a>sprawdzi się solo w mniejszych pomieszczeniach. Dwa lub więcej <a href=\"https://light-home.pl/79-plafony-domowe-wewnetrzne\" title=\"plafony wewnętrzne\">plafonów wewnętrznych</a> oświetli wnętrze o większym metrażu.<br /><br /></p>','HOLDI 2202/1/OP','lampa-sufitowa-plafon-szklany-klosz',NULL,NULL,NULL,'Lampa Sufitowa Plafon Szklany Klosz',NULL,NULL,NULL,NULL),
('476','1','1','<p><a href=\"https://light-home.pl/53-lampy-sufitowe\" title=\"minimalistyczna lampa sufitowa\">Minimalistyczna lampa sufitowa nowoczesna</a> doda uroku każdemu wnętrzu. Pojedyncze <a href=\"https://light-home.pl/84-zrodla-swiatla\" title=\"źródło światła\">źródło światła</a> sprawdzi się solo w mniejszych pomieszczeniach. Dwa lub więcej <a href=\"https://light-home.pl/79-plafony-domowe-wewnetrzne\" title=\"plafony wewnętrzne\">plafonów wewnętrznych</a> oświetli wnętrze o większym metrażu.<br /><br /></p>','HOLDI 2202/1/OP/Z','lampa-sufitowa-plafon-krysztal-szklany-zloty-klosz',NULL,NULL,NULL,'Lampa Sufitowa Plafon Kryształ Szklany Złoty Klosz',NULL,NULL,NULL,NULL),
('477','1','1','<p>Zastanawiasz się, jak nadać blasku w pomieszczeniach, a jednocześnie zachować dozę elegancji? Mamy <a href=\"https://light-home.pl/53-lampy-sufitowe\" title=\"lampa sufitowa\">lampę sufitową</a>, której szukasz. Designerski klosz z przezroczystego szkła sprawdza się w każdej aranżacji, pozwalając zachować harmonię nawet w jaskrawych wystrojach wnętrz.<br /><br /></p>','HOLDI 2203/1/OP','plafon-lampa-sufitowa-pojedyncza-szklany-klosz',NULL,NULL,NULL,'Plafon Lampa Sufitowa Pojedyncza Szklany Klosz',NULL,NULL,NULL,NULL),
('478','1','1','<p>Lampa sufitowa, która idealnie uzupełnia każdą nowoczesną aranżację. Połączenie czarnego metalu, szkła i złota sprawia, że w Twoim domu zapanuje przytulny klimat. Delikatna kolorystyka sprawia, że bez problemu dopasujesz <a href=\"https://light-home.pl/56-lampy-sufitowe-ze-szklanymi-kloszami\" title=\"lampa sufitowa ze szkła\">lampę sufitową ze szklanym kloszem</a> do większości pomieszczeń.<br /><br /></p>','HOLDI 2203/1/OP/Z','lampa-sufitowa-plafon-zloty-szklany-klosz',NULL,NULL,NULL,'Lampa Sufitowa Plafon Złoty Szklany Klosz',NULL,NULL,NULL,NULL),
('479','1','1','<p>Jeżeli jesteś fanem minimalizmu, ale potrzebujesz większej ilości światła, ta <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\">nowoczesna lampa</a> będzie idealna. <strong>Uniwersalna kolorystyka</strong> doskonale wpasuje się w każdą aranżację, tworząc spójną kompozycję i wyjątkowy efekt. <strong>Trwałość surowców</strong> i <strong>urokliwa forma</strong> powodują, że lampa zachwyca mieszkańców i gości przez długie lata. <br /><br /></p>','HOLDI 2203/2','wiszaca-lampa-na-belce-z-dwoma-kloszami',NULL,NULL,NULL,'Wisząca Lampa na Belce z Dwoma Kloszami',NULL,NULL,NULL,NULL),
('480','1','1','<p><a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\">Nowoczesna lampa wisząca </a>ze względu na swoją urokliwą formę potrafi wpasować się w każdą funkcjonalną czy stylizowaną aranżację. <strong>Ciepła barwa metalowych wstawek</strong> to gwarancja przytulnej atmosfery. Oświetlenie ze szklanym kloszem i ciekawą konstrukcją to połączenie funkcjonalności i elegancji, która zadowoli każdego. <br /><br /></p>','HOLDI 2203/2/Z','elegancka-lampa-regulowana-ze-szklanymi-kloszami',NULL,NULL,NULL,'Elegancka Lampa Regulowana ze Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('481','1','1','<p>Klasyka i prostota czarnej konstrukcji w połączeniu ze szklanym kloszem dodaje elegancji Twojemu wnętrzu.<strong> Regulowana długość</strong> pozwala na indywidualną aranżację przestrzeni. <strong>Dwa źródła światła</strong> zapewniają znakomite oświetlenie Twojego pokoju. Produkt wykonany w całości w Polsce. <br /><br /></p>','HOLDI 2202/2','klasyczna-i-elegancka-lampa-ze-szklanymi-kloszami',NULL,NULL,NULL,'Klasyczna i Elegancka Lampa ze Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('482','1','1','<p><a href=\"https://light-home.pl/24-lampy-wiszace-ze-szklanymi-kloszami\">Lampa ze szklanymi kloszami</a> o niewielkich rozmiarach,<strong> z możliwością regulacji długości kabla</strong>. <strong>Delikatne złocenia na brzegach klosza</strong> dodają jej ponadczasowego wdzięku i sprawiają, że świetnie się sprawdzi we wnętrzach, w których chcesz uzyskać efekt rodzinnej przytulności.<br /><br /></p>','HOLDI 2202/2/Z','dekoracyjna-lampa-wiszaca-z-mozliwoscia-regulacji',NULL,NULL,NULL,'Dekoracyjna Lampa Wisząca z Możliwością Regulacji',NULL,NULL,NULL,NULL),
('483','1','1','<p>Jeżeli jesteś właścicielem większego pomieszczenia, a także cenisz sobie proste i efektowne projekty - ta<a href=\"https://light-home.pl/21-lampy-wiszace\"> lampa wisząca</a> jest dla Ciebie!<br /><br /></p>','HOLDI 2200/6','wiszaca-lampa-ze-szklanymi-kloszami-do-duzych-pomieszczen',NULL,NULL,NULL,'Wisząca Lampa ze Szklanymi Kloszami do Dużych Pomieszczeń',NULL,NULL,NULL,NULL),
('484','1','1','<p>Lampa dla osób ceniących sobie ponadczasowy projekt, a także zastosowanie szkła, jako elementu dekoracyjnego. Pozwól, aby złociste refleksy świetlne wypełniły całe pomieszczenie i sprawiły, aby chciało się w nich przebywać bez końca. <br /><br /></p>','HOLDI 2202/6','elegancka-regulowana-lampa-wiszaca-ze-szklanymi-kloszami',NULL,NULL,NULL,'Elegancka Regulowana Lampa Wisząca ze szklanymi Kloszami',NULL,NULL,NULL,NULL),
('485','1','1','<p><strong>Lampa wisząca, o sześciu źródłach światła</strong> nada Twojemu wnętrzu prawdziwie magicznego charakteru. <strong>Czarna konstrukcja z metalu</strong>, w połączeniu ze szkłem dekorowanym złotymi obwódkami pomoże Ci uzyskać klimat radosnego spokoju i umili niejedno rodzinne spotkanie. <br /><br /></p>','HOLDI 2202/6/Z','lampa-wiszaca-o-szesciu-zrodlach-swiatla',NULL,NULL,NULL,'Lampa Wisząca o Sześciu Źródłach Światła',NULL,NULL,NULL,NULL),
('486','1','1','<p>Ta <strong>niewielka regulowana lampa</strong> wisząca dopełni wyposażenie Twojego pokoju dziennego, jadalni czy sypialni, nadając wnętrzu wyjątkowego charakteru. Połączenie złotego koloru, którego użyto do dekoracji szklanego klosza z czernią metalowej konstrukcji sprawia, że na tę lampę aż chce się patrzeć! <br /><br /></p>','HOLDI 2202/1/Z','regulowana-lampa-wiszaca-ze-szklanym-kloszem',NULL,NULL,NULL,'Regulowana Lampa Wisząca ze Szklanym Kloszem',NULL,NULL,NULL,NULL),
('487','1','1','<p>Ten produkt charakteryzuje się <strong>unikalnym kształtem klosza, o lekko owalnym przekroju</strong>. Projektant wykorzystał metalową obudowę w kolorze czarnym, dopełniając ją szklanym kloszem osadzonym na złotych obręczach. Całość stanowi wdzięczną i elegancką całość. To połączenie klasyki jak i funkcjonalności. <br /><br /></p>','HOLDI 2203/1/Z','unikalna-lampa-z-kloszem-ze-szkla',NULL,NULL,NULL,'Unikalna Lampa z Kloszem ze Szkła',NULL,NULL,NULL,NULL),
('488','1','1','<p>Luksusowe dodatki do wnętrz kojarzą nam się z przepychem, ale czy luksus jest definiowany jedynie przez przepych? Nasza <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\">nowoczesna lampa wisząca</a> ze szklanym kloszem to minimalistyczna i elegancka wersja lampy do salonu lub kuchni w stylu premium.<br /><br /></p>','HOLDI 2202/1','elegancka-lampa-do-salonu-lub-kuchni',NULL,NULL,NULL,'Elegancka Lampa do Salonu lub Kuchni',NULL,NULL,NULL,NULL),
('489','1','1','<p><strong>Geometria, przezroczystość i ostro ścięte szkło</strong> - efekt wielowymiarowości oddaje niesamowita lampa ze szklanym kloszem. Przezroczyste szkło to trend w aranżacji pomieszczeń, który możemy spotkać w architektonicznych katalogach. <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\">Nowoczesna lampa</a> ze szklanym kloszem sprawdza przy rozświetlaniu eleganckich wnętrz. <br /><br /></p>','HOLDI 2203/1','pojedyncza-lampa-wiszaca-ze-szklanym-kloszem',NULL,NULL,NULL,'Pojedyncza Lampa Wisząca ze Szklanym Kloszem',NULL,NULL,NULL,NULL),
('490','1','1','<p>Pomieszczenie, w którym znajdzie się dwupłomienna <a href=\"https://light-home.pl/24-lampy-wiszace-ze-szklanymi-kloszami\">lampa wisząca ze szklanymi kloszami</a> zyska na względach estetycznych. Wbrew surowej, szklanej formie, <strong>dwupłomienna lampa</strong> na czarnej listwie nastrojowo oświetli wybrany pokój.<br /><br /></p>',NULL,'dwuplomienna-lampa-wiszaca-ze-szklanymi-kloszami',NULL,NULL,NULL,'Dwupłomienna Lampa Wisząca ze Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('491','1','1','<p>Kompozycja lamp w wybranych kolorach to świetna okazja do zaprezentowania swojego aranżacyjnego gustu. Połączenie miodowo - grafitowych barw musi być udane, zwłaszcza, jeśli mowa o barwionym szkle. <strong>Półprzezroczyste klosze z barwionego szkła</strong> to hit dekoracyjny. <br /><br /></p>',NULL,'lampa-o-trzech-zrodlach-swiatla-ze-szklanymi-kloszami',NULL,NULL,NULL,'Lampa o Trzech Źródłach Światła ze Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('492','1','1','<p><strong>Szklany klosz z wgłębieniami</strong> pozwala dopełnić aranżację nowoczesnego pomieszczenia. W zależności od reszty dodatków i mebli - dopasowanie idealnego koloru klosza nie jest trudne. Mamy do wyboru modne aktualnie kolory, które pasują do modernistycznych i loftowych wnętrz. <br /><br /></p>',NULL,'loftowa-lampa-wiszaca-ze-szklanym-kloszem',NULL,NULL,NULL,'Loftowa Lampa Wisząca ze Szklanym Kloszem',NULL,NULL,NULL,NULL),
('493','1','1','<p><strong>Sześć źródeł światła</strong> to gwarancja dokładnie oświetlonego wnętrza. <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\">Nowoczesny model lampy wiszącej</a> na listwie dopełnia każde pomieszczenie. Charakterystyczne dla tego modelu wgłębienia w szkle to gratka dla kolekcjonerów wyjątkowych dodatków i stylowych aranżacji.<br /><br /></p>',NULL,'szescioplomienna-lampa-wiszaca-ze-szklanymi-kloszami',NULL,NULL,NULL,'Sześciopłomienna Lampa Wisząca ze Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('494','1','1','<p><strong>Niecodzienne wgłębienia w szkle i efekt półprzezroczystości</strong> to dwie proste rzeczy, które składają się na zjawiskową konstrukcje stylowej <a href=\"https://light-home.pl/24-lampy-wiszace-ze-szklanymi-kloszami\">lampy wiszącej ze szklanymi kloszami</a>. Czarna, metalowa podsufitka i klosze z surowego szkła to kontrastowe połączenie, które doskonale ze sobą współgra.<br /><br /></p>',NULL,'regulowana-lampa-wiszaca-z-trzema-zrodlami-swiatla',NULL,NULL,NULL,'Regulowana Lampa Wisząca z Trzema Źródłami Światła',NULL,NULL,NULL,NULL),
('495','1','1','<p>Modernistyczne projekty lamp to świetny sposób, aby dodać do pomieszczenia świeżości. Wybierając lampę ze szklanym żyrandolem z pewnością uzyskamy taki efekt. <strong>Geometryczna forma klosza i przezroczyste szkło</strong> to skompresowana formuła modernizmu.<br /><br /></p>','HOLDI 2201/1','wiszaca-lampa-nowoczesna-ze-szklanym-kloszem',NULL,NULL,NULL,'Wisząca Lampa Nowoczesna ze Szklanym Kloszem',NULL,NULL,NULL,NULL),
('496','1','1','<p><strong>Klasyczne wzornictwo i sprawdzony projekt</strong> za każdym razem jest dobrym rozwiązaniem. Elegancka lampa wisząca z dwoma źródłami światła gwarantuje Ci dobry wygląd i dokładne oświetlenie pomieszczenia. Jasna kolorystyka to uniwersalna propozycja dla wnętrz urządzonych w bardzo zróżnicowanych stylach.<br /><br /></p>',NULL,'dwuplomienna-biala-lampa-typu-plafon',NULL,NULL,NULL,'Dwupłomienna Biała Lampa Typu Plafon',NULL,NULL,NULL,NULL),
('497','1','1','<p><strong>Półtransparentny szklany klosz</strong> w połączeniu z metalowym wykończeniem lampy daje nowoczesny efekt. Eklektyczna lampa wisząca to świetne uzupełnienie nowoczesnego lokum lub urządzonego w stylu art - deco czy loft. <br /><br /></p>','OSLO 2234/3/OW/M/MIX','lampa-wiszaca-o-trzech-zrodlach-swiatla-ze-szklanymi-kloszami',NULL,NULL,NULL,'Lampa Wisząca o Trzech Źródłach Światła ze Szklanymi Kloszami',NULL,NULL,NULL,NULL),
('498','1','1','<p>Nastrojowe wnętrza chwytają za serce, można spojrzeć na fotografie pięknych aranżacji i poczuć nastrój ze zdjęcia. Jak stworzyć przytulną atmosferę w swoim domu? Z prezentowanym modelem lampy wiszącej w czarnym kolorze masz to na wyciągnięcie ręki. Nasz model nowoczesnej lampy daje <strong>subtelne światło</strong> i pięknie eksponuje <a href=\"https://light-home.pl/87-zarowki-dekoracyjne\">dekoracyjne żarówki. </a></p>','OSLO 2234/3/OW/M/MIX','nowoczesna-lampa-z-metalu-i-szkla-o-trzech-zrodlach-swiatla',NULL,NULL,NULL,'Nowoczesna Lampa z Metalu i Szkła o Trzech Źródłach Światła',NULL,NULL,NULL,NULL),
('499','1','1','<p>Powielanie prostych, uniwersalnych schematów sprawdziło się w projekcie prezentowanej lampy. Trójpłomienna <a href=\"https://light-home.pl/22-lampy-wiszace-nowoczesne\">nowoczesna lampa wisząca</a> to <strong>minimalistyczny i nowoczesny projekt</strong>, któremu nie sposób odmówić szyku. Relatywnie<strong> prosta i geometryczna budowa</strong> pozwala każdemu odnaleźć w jej konstrukcji coś dla siebie. Nam najbardziej podoba się pomysł połączenia czarnego metalu i subtelnego szkła. <br /><br /></p>','OSLO 2231/3/OW/M','wiszaca-lampa-z-kloszami-ze-szkla-w-kolorze-miodowym',NULL,NULL,NULL,'Wisząca Lampa z Kloszami ze Szkła w Kolorze Miodowym',NULL,NULL,NULL,NULL),
('500','1','1','<p>Awangardowa i nowoczesna lampa, która uroczo dekoruje najbardziej potrzebujące blasku wnętrza! Z lampą z półtransparentnymi kloszami możemy zaznaczyć istotną rolę światła w pomieszczeniu. <strong>Przyciemniane szkło</strong> oddaje dokładnie taką jego ilość, która będzie wystarczająca dla zachowania przyjemnej atmosfery i dobrej widoczności. <br /><br /></p>','OSLO 2231/3/OW','nowoczesna-lampa-o-trzech-zrodlach-swiatla-ze-szklanymi-kloszami',NULL,NULL,NULL,'Nowoczesna Lampa o Trzech Źródłach Światła ze Szklanymi Kloszami',NULL,NULL,NULL,NULL);
